Description = {"\"Saya akan lihat melalui usaha kamu dan memutuskan apakah kamu memenuhi syarat atau tidak. Kamu harus membawa ^3355FFPorcupine Quill, Cobweb, Bug Leg^000000.\""}
, Summary = "Bawakan 5 Porcupine Quill, 20 Cobweb, 10 Bug Leg pada Bapa Moohae"}
, 
[3024] = {Title = "Quest Rubah Job Monk - Meet \'Tohobu\'.", 
Description = {"\"Baiklah, Monk selanjutnya yang kamu harus temui adalah...OH! Pergilah ke \'Douha\'. Pergi ke utara dari sini dan kamu akan bertemu dengan dia di makam.\""}
, Summary = "Touha"}
, 
[3025] = {Title = "Quest Rubah Job Monk - Dogma Test", 
Description = {"\"Saya akan mengajarkan kamu jalan dari monk -- sikap mental yang diperlukan dan ajaran kami. Kamu hanya perlu untuk mengingat apa yang saya katakan kepada kamu dan selalu mengingatnya. Apakah kamu siap?\""}
, Summary = ""}
, 
[3026] = {Title = "Quest Rubah Job Monk - Meet \'Boohae\'", 
Description = {"\"Bagus!! Sempurna! Kamu telah lulus ujian saya. Tetapi kamu masih harus mengambil tes lain. Tolong selanjutnya pergi ke \'Puhae\' . Semoga beruntung!\""}
, Summary = " Puhae"}
, 
[3027] = {Title = "Quest Rubah Job Monk - Gathering Mushroom", 
Description = {"\"Ujian mengumpulkan jamur adalah ujian kesabaran. Di pusat dari gedung biara. Pergilah ke sana.\""}
, Summary = "Kumpulkan Jamur"}
, 
[3028] = {Title = "Quest Rubah Job Monk - Marathon", 
Description = {"\"Ujian marathon adalah ujian untuk mengatasi keterbatasan kamu. Di pusat dari gedung biara. Pergilah ke sana. Kamu perlu menjalankan beberapa perubahan.\""}
, Summary = "Lari Marathon"}
, 
[3029] = {Title = "Quest Rubah Job Monk - Final test", 
Description = {"\"Selamat!! Sekarang, pergi ke monk \'Taomoon\'. Dia berada di tempat yang jauh di bangunan pusat dari biara.\""}
, Summary = "Temui Taomoon"}
, 
[3031] = {Title = "Quest Rubah Job Monk - Spiritual Training", 
Description = {"\"Ujian terakhir adalah ujian rohani! Serang dan tebas semua musuh yang berdiri di jalan kamu! Sekarang! Pakai tinju kamu! Bangunlah! Inilah waktunya!\""}
, Summary = "Ujian terakhir, serang semua yang berada dihadapanmu"}
, 
[3032] = {Title = "Quest Rubah Job Monk - Become a Monk", 
Description = {"\"Bagus!! Sekarang... Saya akan memberikan kamu ramuan rahasia. Jika kamu meminum ini, Kamu akan mempunyai cukup kekuatan fisik untuk dapat mengubah menjadi Monk! Pergilah kembali kepada sensei, \'Muhae\'!"}
, Summary = " "}
, 
[3040] = {Title = "Kutukan Baphomet - Makam Terkutuk", 
Description = {"\"Kamu tidak dapat masuk karena kutukan Baphomet masih ada. Kutukan Baphomet hilang setelah 12 jam kamu masuk.\""}
, Summary = ""}
, 
[3041] = {Title = "Kutukan Baphomet - Hilangnya Kekuatasn Sihir", 
Description = {"Kamu tidak dapat menggunakan kekuatan sihir kamu selama 3 menit karena kamu menghabiskan SP di altar.\""}
, Summary = ""}
, 
[3042] = {Title = "Identisal Asli Cursed Baphomet Doll", 
Description = {"Friar Patrick menyarankan kamu bertemu dengan Rust Blackhand yang berada bangunan utama dari biara. Dia mengatakan Rust Blackhand akan membuat Cursed Baphomet Doll berguna."}
, Summary = ""}
, 
[3043] = {Title = "Gigantic Magestic Goat", 
Description = {"Rust Blackhand mengatakan ia dapat membuat Magestic Goat dengan kekuatan yang sebenarnya jika kamu membawa semua bahan yang dia butuhkan."}
, Summary = "Cursed Baphomet Doll, Magestic Goat, 30 Dark Crystal, 50 Dark Debris, dan 990000 Zeny"}
, 
[3050] = {Title = "Bangkitnya Satan Morroc - Berita Kehancuran Morroc Village", 
Description = {"\"Satan Morroc telah dibangkitkan dan menghancurkan kota Morroc, dan sekarang dia bergerak ke arah gurun pasir Sograt. Jika kamu menganggap diri kamu petualang pemberani, silakan kamu pergi mencari Chief Balrog dari Continental Guards di kota Morroc.\""}
, Summary = "Balrog"}
, 
[3051] = {Title = "Bangkitnya Satan Morroc - Tes Seleksi", 
Description = {"\"Jika kamu bergabung dengan Continental Guard, kamu perlu menunjukan kemampuan kamu. Saya rasa itu adil saya akan mengakui kekuatan kamu jika kamu dapat menangani masalah saya. Bawakan kembali 30 Live Coal!\""}
, Summary = "30 Live Coal"}
, 
[3052] = {Title = "Bangkitnya Satan Morroc - Tes Seleksi ke 2", 
Description = {"\"Saya masih tidak cukup yakin kamu cukup baik untuk bergabung dengan kami. Ujian belum selesai. Jika kamu bersikeras untuk mencobanya, lalu... Saya membutuhkan 50 of Glacial Heart.\""}
, Summary = "50 Glacial Heart"}
, 
[3053] = {Title = "Bangkitnya Satan Morroc - Bergabung dengan Continental Guard", 
Description = {"\"Saya mengakui bahwa saya sungguh tertarik dengan kemampuan dan kecerdasan kamu. Selamat datang di Continental Guard, temanku. Apakah kamu sudah siap dengan resiko hidup kamu demi perdamaian dunia?\""}
, Summary = "Cegah Satan Morroc mendapatkan kekuatannya kembali"}
, 
[3054] = {Title = "Bangkitnya Satan Morroc - Mengalahkan  Satan Morroc!", 
Description = {"Satan Morroc akhirnya didorong keluar dari Rune Midgard dan menghilang melalui ruang dan waktu. Kamu dapat melihat potongan-potongan yang mengapung dari ruang dimensi."}
, Summary = ""}
, 
[3055] = {Title = "Bangkitnya Satan Morroc - Retaknya Ruang dan Waktu", 
Description = {"Kamu meregangkan tangan kamu dan mengambil sebuah benda. Ini bagian dari kulit Satan Morroc. Ini akan menjadi bukti bahwa kamu telah mengalahkan Satan Morroc."}
, Summary = ""}
, 
[3056] = {Title = "Bangkitnya Satan Morroc - Hadiah", 
Description = {"\"Selamat, Prajurit. Kamu telah menyelamatkan dunia dan orang-orang yang menjadi korban dari kerusakan dan kejahatan. Saya mempunyai tiga barang. Pilih salah satu yang ingin kamu ambil?\""}
, Summary = "Pilih hadiahmu"}
, 
