[5000] = {Title = "Endangered Species", 
Description = {"Katak kami berada di ambang kepunahan karena para wisatawan mencuri telur kita sebagai souvenir. Dan kemudian sembarang melemparkanya tanpa perasaan. Tolong bawakan kembali kepada saya ^FF0000100 Spawn^000000s"}
, Summary = "Bawakan Frog Spawns kepada Gegor the 7th."}
, 
[5001] = {Title = "Revenge of the Webbed", 
Description = {"Ular menganggap kita sebagai semacam makanan kesehatan untuk mereka. Betapa menyedihkan ini? Jadi tolonglah, bantu kita membalas dendam dengan membunuh ^FF000050 Sidewinders ^000000. Ini akan membantu meringankan kesedihan kita. "}
, Summary = "Bunuh 50 Sidewinder"}
, 
[5002] = {Title = "Hero of the Frogs", 
Description = {"Tindakan kamu merupakan dorongan untuk para katak-katak. Untuk itu, saya ingin menempatkan kamu di Frog Chronicles,  jadi bawakan bukti kuat kamu dengan membawakan  ^FF0000100 Venom Canines^000000."}
, Summary = "Bawakan Venom Canines kepada Gegor 7th"}
, 
[5003] = {Title = "Frog Stealth", 
Description = {"Kami akhirnya menemukan cara untuk melindungi ras kita! Jawabanya ada di dalam Frog Chronicles. Para Gegor ke-3 membuat ramuan untuk memungkinkan Katak untuk menghindari ular dengan cara diam-diam. Pergilah sekarang dan berikan saya ^FF000050 Scale Shells^000000"}
, Summary = "Bawakan Scale Shells kepada Gegor the 7th"}
, 
[5004] = {Title = "Short on Food", 
Description = {"Kamu adalah pahlawan kami! Berkat anda, ras kita berkembang, tapi sayangnya kita kekurangan makanan. Apa lagi yang kamu tunggu, Pahlawan katak ? Tolong bawakan kami ^FF000050 Argiopes^000000, Makanan kesukaan kami!"}
, Summary = "Berikan mereka makanan, Argiope."}
, 
[5016] = {Title = "Bawakan aku Alat Penelitian", 
Description = {"Para Peneliti Raffle mengatakan bahwa mereka diserang oleh Unidentified Life dan hasil penelitian mereka telah dicuri."}
, Summary = "Pergilah untuk mengambil kembali penelitian dari Unidentified Life dan berikan pada peneliti."}
, 
[5017] = {Title = "Pembalasan Peneliti", 
Description = {"Asisten peneliti mengatakan bahwa kamu harus membantu mereka agar pikiran mereka tenang, karena itulah satu-satunya cara agar mereka bisa melakukan penelitian. Ayo kalahkan Unidentified Life 3 kali."}
, Summary = "Kalahkan Unidentified Life Bathtub 3 kali."}
, 
[5018] = {Title = "Pembalasan Peneliti", 
Description = {"Selesai mengalahkan Unidentified Life Bathtub."}
, Summary = "Kembalilah pada peneliti Raffle."}
, 
[5019] = {Title = "Sampel Penelitian Pemandian", 
Description = {"Penelitian dengan skala besar telah dimulai. Untuk memulai penelitian, mereka memerlukan Test-subject! Pergilah ke Bathtub dan dapatkan 10 Test-subject demi penelitian."}
, Summary = "Kamu bisa mendapatkan Test-subject dari Bathtub."}
, 
[5020] = {Title = "Menagamati Sampel", 
Description = {"Para peneliti kini melakukan tes dasar pada Test-subject. Mereka mengatakan akan membutuhkan sekitar 24 jam untuk menyelesaikannya. Karena tidak ada lagi yang bisa dilakukan, bagaimana kalau beristirahat!"}
, Summary = "Kembali ke peneliti setelah 24 jam."}
, 
[5021] = {Title = "Mengumpulkan Sampel", 
Description = {"Peneliti Bathtub menemukan bahwa Test-subject memiliki DNA yang menarik. Untuk membandingkan DNA yang tidak dikenal DNA, pergilah ke Bathtub untuk mengumpulkan sampel gigi."}
, Summary = "Sampel bisa didapatkan dari Bathtub."}
, 
[5022] = {Title = "Mengumpulkan Sampel", 
Description = {"Peneliti Bathtub menemukan bahwa Test-subject memiliki DNA yang menarik. Untuk membandingkan DNA yang tidak dikenal DNA, pergilah ke Bathtub untuk mengumpulkan sampel sisik."}
, Summary = "Sampel bisa didapatkan dari Bathtub."}
, 
[5023] = {Title = "Spesimen selama pengujian", 
Description = {"Para peneliti saat ini menganalisa sampel yang telah kamu bawa kembali untuk DNA yang menarik."}
, Summary = "Kembali ke peneliti setelah 6 jam."}
, 
[5024] = {Title = "Penelitian kolam timur", 
Description = {"Para peneliti mengatakan bahwa mereka lebih penasaran setelah menemukan DNA yang menarik. Untuk memenuhi rasa penasaran mereka, mereka memintamu untuk pergi ke East Pool dan mengumpulkan lebih banyak sampel untuk mereka."}
, Summary = "Pergilah ke East Pool dan kumpulkan sampel kemudian berikan kepada peneliti."}
, 
