, Summary = "Kembali ke peneliti setelah 12 jam."}
, 
[5029] = {Title = "Makhluk yang tidak dikenal", 
Description = {"Telah terjadi pertempuran dengan Unidentified Life. Kita sembuhkan pikiran dan tubuh yang lelah."}
