, 
[7027] = {Title = "Pengejaran Rayan Moore", 
Description = {"Kamu mendengar beberapa cerita yang mencurigakan saat menyelidiki bangunan di mana kamu tiba dengan menggunakan scroll. Kamu dengar bahwa meraka berselisih satu sama lain .. "}
