, 
[7028] = {Title = "Pengejaran Rayan Moore", 
Description = {"Kamu bilang Mr Kidd apa yang kamu dengar dari ruang bawah tanah di rumah kosong dekat perbatasan nasional. Akan ada perselisihan internal yang serius dan itu akan menjadi waktu yang tepat untuk menyerang mereka."}
