, 
[7039] = {Title = "Menghindari Pembicaraan", 
Description = {"Kamu mempertanyakan Defaria berulang-ulang dan dia tampaknya mulai berbicara tentang Dandelion. Namun, dia mengubah topik lagi dan meminta kamu untuk mengirimkan beberapa ubi bakar untuk Mr Kidd. "}
, Summary = "Antarkan 2 sweet potatoe untuk Mr Kidd"}
, 
[7040] = {Title = "Menghindari Pembicaraan", 
