, Summary = "Antarkan 2 sweet potatoe untuk Echinacea"}
, 
[7041] = {Title = "Politik hanya untuk Politisi", 
Description = {"Echinacea menyarankan agar kamu tidak mempertanyakan motif para politisi dan percaya bahwa mereka akan melakukan apa pun untuk menjaga perdamaian. Kembali ke Defaria dan berterima kasih untuk Sweet Potato."}
, Summary = "Defaria"}
, 
[7042] = {Title = "Kerja Sampingan - Memberi makan Tatacho", 
Description = {"Tolong bawakan saya 50 Fresh Fish. Mereka pakan Tatacho. Aku kehabisan, dan aku perlu mengisi ulang segera. Kamu dapat menemukannya dari Tatacho di field."}
, Summary = "50 Fresh Fish"}
, 
[7043] = {Title = "Kerja Sampingan - Memberi makan Cornus", 
Description = {"Saya baru saja kehabisan pakan untuk Cornus. Tolong bawakan saya 30 Great Leaf dan 30 Brown Root. Kamu dapat menemukannya dari Pinguicula."}
