, 
[7044] = {Title = "Kerja Sampingan - Memberi makan Hillslion 1", 
Description = {"Saya baru saja kehabisan pakan untuk Hillslion. Para scholar menganggap meraka ini adalah anggota dari keluarga kucing. Aku sudah berusaha untuk memberi makan mereka berbagai hal .. Kali ini ... aku ingin mencoba Monster Feed. Tolong bawakan saya Feed 20 Monster Feed dan 30 Pet Food"}
