, 
[7045] = {Title = "Kerja Sampingan - Memberi makan Hillslion 2", 
Description = {"Ini sempurna, karena aku akan mencoba beberapa pakan baru untuk Hillslions. Aku mencoba Monster Feed, tapi saya tidak tahu apakah mereka suka atau tidak. Tolong bawakan saya 50 Meat dan 30 Pet Foods"}
, Summary = "50 Meat dan 30 Pet Food"}
, 
[7046] = {Title = "Kerja Sampingan - Karpet Hangat", 
