Description = {"Anda jatuh antara akar pohon raksasa. Anda telah menemukan sebuah suku raksasa disebut \'Sapha,\' keras seperti batu dan sebesar gunung. Sepertinya tidak ada jejak yang tersisa dari Terra."}
