, 
[7117] = {Title = "Langkah Pertama dalam Ragnarok", 
Description = {"Bila Anda melewati jembatan, Anda dapat melihat sebuah istana yang digunakan sebagai tempat pelatihan. Saya akan menunggu Anda di dalam, datang ke puri itu sendiri. "}
, Summary = "Temui Spraki yang ada di dalam pelatihan "}
, 
[7118] = {Title = "Pusat Pelatihan Novice - 1", 
