, 
[7125] = {Title = "not used", 
Description = {" "}
, Summary = ""}
, 
[7126] = {Title = "Skill Khusus", 
Description = {"Menjual item pada pedagang dengan harga yang lebih tinggi, ^5d5dff 300 zeny^000000 seharusnya cukup. Dengan Menggunakan skill \'overcharge\' dan \'discount\' dari manual merchant."}
, Summary = "Mendapatkan 300 zeny"}
, 
[7127] = {Title = "Dasar Pertempuran - 3", 
Description = {"Bisa mengalahkan 5 of wilow? Jika kamu menggunakan manual Thief, kamu dapat menggunakan skill \'double attack\'. Anda dapat pindah ke tempat di mana munculnya wilow melalui [pman]."}
, Summary = "Kalahkan 5 wilow"}
, 
[7128] = {Title = "Kursus pelatihan \'menaklukan gurun! - mulai", 
