, Summary = "Kalahkan 10 condor"}
, 
[7130] = {Title = "Kursus pelatihan \'menaklukan gurun!\' - Pertarungan2", 
Description = {"Pelatihan ini untuk mencari baby desert wolf yang dapat melukai kepala orang bila sudah besar! pergi dan kalahkan 10 atau lebih baby desert wolf!"}
