, 
[7140] = {Title = "Kursus pelatihan \'menaklukan gua hantu!\' - Pertarungan2", 
Description = {"Selanjutnya adalah poporing, kamu sudah melihatnya saat berburu skeleton. Mahluk berwarna hijau yang berkeliaran...ini hal terakhit yang kamu lakukan di Gua Payon."}
