, 
[7142] = {Title = "Kursus pelatihan \'menaklukan neraka semut!\' - Mulai", 
Description = {"Anda mengikuti pelatihan untuk pemula dari Tim Paradise. Pergi ke Neraka Semut yang ada di utara benteng Sandarman. Anda harus mencari pria yang akan mengirim Anda ke Benteng Sandarman di selatan moroc. Temui anggota Tim Paradise bila Anda memasuki neraka semut."}
, Summary = "Percakapan dengan Clode dalam neraka semut "}
, 
[7143] = {Title = "Kursus pelatihan \'menaklukan neraka semut!\' - Pertarungan1", 
Description = {"Ada banyak semut berkerumun di sini. Ok, kalahkan 15 \'pierre\' itu adalah semut paling lemah. Hati-hati mereka menyerang bersama-sama."}
, Summary = "Kalahkan 15 pierre."}
, 
[7144] = {Title = "Kursus pelatihan \'menaklukan neraka semut!\' - Pertarungan2", 
Description = {"Target kedua adalah Andre, lebih kuat dari Pierre. Jika Anda tidak dapat menemukannya, pergi ke lantai dua. Tapi, Anda harus berhati-hati terhadap Maya."}
, Summary = "Kalahkan 15 Andre"}
, 
[7145] = {Title = "Kursus pelatihan \'menaklukan neraka semut!\' - Pertarungan3", 
Description = {"Target selanjutnya adalah ... vitata seperti yang Anda harapkan! Jika Anda mengalahkan vitata yang merawat telur semut, tak seorang pun akan terancam dalam neraka semut. Mari kita kalahkan 10 vitata."}
, Summary = "Kalahkan 10 vitata"}
, 
[7146] = {Title = "Kursus pelatihan \'menaklukan neraka semut!\' - Quest Selesai", 
Description = {"Anda menyelesaikan semua tugas yang diberikan oleh Clode. kembali dan melapor ke kantor Tim Paradise."}
