, 
[7147] = {Title = "Kursus pelatihan \'menaklukan desa orc!\' - Mulai", 
Description = {"Anda mengikuti pelatihan untuk pemula dari Tim Paradise. Tujuannya adalah desa Orc, akan ada delegasi dekat bangunan tempat kafra. Anda dapat berpindah tempat dengan mudah melalui layanan kafra antara geffen atau prontera."}
