, Summary = "Kalahkan 10 orc warrior"}
, 
[7150] = {Title = "Kursus pelatihan \'menaklukan desa orc!\' - Pertarungan3", 
Description = {"Anda ingin menaklukkan sebuah desa Orc, Anda harus menghilangkan mengurangi tingkat kelahiran Orc. Target berikutnya adalah Orc Lady. Tapi Anda tidak perlu sepenuhnya menghancurkan semuanya, hanya perlu kalahkan 10 Orc Lady."}
