, 
[7156] = {Title = "Kursus pelatihan \'menaklukan kota bawah laut!\' - Mulai", 
Description = {"Anda mengikuti pelatihan untuk pemula dari Tim Paradise. Tujuannya adalah adalah Kota bawah laut pulau Byaland. Anda dapat pergi ke sana dengan perahu di pelabuhan Izlude."}
