, 
[7160] = {Title = "Cryptogram Misterius", 
Description = {"Menerima Cryptogram Misterius dari Urpa dari Perkumpulan Rogue. Jika kamu bisa memecahkan kodenya, kamu bisa mendapat petunjuk tentang harta karun. Kode cryptograms [ 43231114345243 / 11441531241542 / 2433 / 3542343344154211 ]."}
, Summary = ""}
, 
[7161] = {Title = "Cryptogram Misterius - 2", 
Description = {"Menerima Cryptogram Misterius dari Graham. Kode cryptograms [ 5 15 24 8 / 9 12 21 8 / 12 17 / 23 24 21 23 15 8 / 12 22 15 4 17 7 / 23 11 12 21 7 / 9 15 18 18 21 ] [Kata kunci : 3]"}
