, Summary = ""}
, 
[7164] = {Title = "Berburu bayangan penipu", 
Description = {"Api Turtle island sepertinya terkait dengan bayangan penipu. Untuk memastikannya, kamu harus mengalahkan bayangan penipu."}
, Summary = "Buru bayangan penipu"}
, 
[7165] = {Title = "Kunci penipu", 
Description = {"Itu bukan harta tapi kunci kecil yang saya temukan di tempat rahasia di Turtle island. Pertama, kembali ke Graham dan melaporkan kepadanya apa yang kamu temukan."}
, Summary = ""}
, 
[7166] = {Title = "Bengkel Bayangan Cabang Rachel", 
Description = {"Mengatakan bahwa manajer cabang rachel memiliki cryptogram yang sama, Graham, manager bengkel banyangan prontera, mengatakan kepada saya untuk menyelidiki lebih banyak dengan petunjuk dari dia."}
, Summary = "Temui manajer bengkel bayangan cabang Rachel"}
, 
[7167] = {Title = "Cryptogram Misterius - 3rd", 
Description = {"Apa arti daru cryptogram yang Paul, manajer cabang rachel, tunjukan? Kode cryptogram [R-E-N-N-N-D / L-N-N-W-W-N-D ]. Saat kamu menemukan jawabannya, bicara pada Paul."}
, Summary = ""}
, 
[7168] = {Title = "Cryptogram Misterius - 3rd", 
Description = {"Kamu menerima cryptogram dan kata kunci milik Paul. [R-E-N-N-N-D / L-N-N-W-W-N-D ] Cryptograms ini tampaknya menunjukkan nama tempat dan arah. Kata kunci yang terpisah adalah [SEED]"}
, Summary = "Cari tempat yang ditunjukan oleh crytogram."}
, 
[7169] = {Title = "Cryptogram Misterius - 3rd", 
Description = {"Kamu menerima cryptogram dan kata kunci milik Paul. [R-E-N-N-N-D / L-N-N-W-W-N-D ] Cryptograms ini tampaknya menunjukkan nama tempat dan arah. Kata kunci yang terpisah adalah [FOOT]"}
, Summary = "Cari tempat yang ditunjukan oleh crytogram."}
, 
[7170] = {Title = "Cryptogram Misterius - 3rd", 
Description = {"Kamu menerima cryptogram dan kata kunci milik Paul. [R-E-N-N-N-D / L-N-N-W-W-N-D ] Cryptograms ini tampaknya menunjukkan nama tempat dan arah. Kata kunci yang terpisah adalah [COLD]"}
, Summary = "Cari tempat yang ditunjukan oleh crytogram."}
, 
[7171] = {Title = "Berburu bayangan khayalan", 
Description = {"Seperti penipu, kamu menemukan adanya hubungan dengan api Turtle Island. Untuk memastikan, kamu harus mengalahkan bayangan khayalan."}
, Summary = "Kalahkan bayangan khayalan"}
, 
[7172] = {Title = "Kunci khayalan", 
Description = {"Itu adalah kunci khayalan yang kamu temukan jauh di dalam ince dungeon. Tapi harta itu tidak juga ada. Kembali lapor pada paul."}
, Summary = ""}
, 
[7173] = {Title = "Pesan untuk Halled dari Paul", 
Description = {"Paul sangat kecewa bahwa itu bukan harta dan menyuruh anda untuk pergi ke Halled, manajer cabang Yuno, yang memiliki petunjuk lain. Bila dia tidak mau membantu Anda, dia bilang kau harus mengatakan pesannya. Pesan dari Paul:^4d4dffAku tahu apa yang Anda lakukan musim panas lalu!^000000"}
, Summary = "Ke Halled, manajer bengkel bayangan cabang Yuno."}
, 
[7174] = {Title = "Cryptogram Misterius - 4th", 
Description = {"Petunjuk bahwa Halled miliki adalah lagu pendek. Aku perlu mencari tempat yang dimaksud oleh lagu ini . [^4d4dffEnd of thin roots from the Life tree / Tears of all the living / Sigh of all the dead / They were but were not us / People of the forgotten night / Midnight wh"}
, Summary = ""}
, 
[7175] = {Title = "Berburu bayangan kegembiraan", 
Description = {"Sebuah nyala memudar setelah bergoyang dan menunjukkan seorang wanita muda. Mungkin aku perlu mengalahkan bayangan kegembiraan."}
, Summary = "Buru Bayangan Kegembiraan"}
, 
[7176] = {Title = "Kunci kegembiraan", 
Description = {"Kunci lagi, bukan harta yang saya temukan kali ini! Dimana sebenarnya harta karun itu? Pertama, temui dan lapor pada Halled."}
, Summary = ""}
, 
[7177] = {Title = "Pemuda di Lighthalzen", 
Description = {"Halled kaget oleh fakta bahwa petunjuk miliknya tidak mengungkapkan tempat harta itu dikubur dan menyuruh saya untuk pergi untuk melihat Vicente, manajer cabang Lighthalzen, yang memiliki petunjuk terakhir."}
, Summary = ""}
, 
[7178] = {Title = "Tujuan dari Penipu, Khayalan dan Kegembiraan", 
Description = {"3 kunci penipu, khayalan dan kegembiraan adalah patung tersembunyi di Thanatos Tower. Tempat di lantai 1 menara Thanatos dimana tiang cahaya muncul."}
, Summary = ""}
, 
[7179] = {Title = "Vicente, kamu berani!", 
Description = {"Menemukan tempat itu dengan informasi dari Vicente, saya membuka patung itu dengan penuh harap tetapi hanya menemukan pensil rambut. Itu bukan harta lagi. Saya perlu menemui Vicente sekarang!"}
, Summary = "Beri aku harta karun. Saya merasa pusing"}
, 
[7180] = {Title = "Pesan dari Doomk", 
Description = {"Pasokan akan diberikan dari guild dalam waktu dekat. Tapi, saya tidak tahu kapan. Lagi pula, ketika mereka diberikan, aku akan mengambil punyamu juga. Jadi, jangan lupa untuk mampir kapan."}
, Summary = ""}
, 
[7181] = {Title = "Ring Karakas", 
Description = {"Aku menerima Ring Karakass, yang dapat dipakai pada waktu tertentu."}
, Summary = ""}
, 
[7182] = {Title = "Kunjungan Sapha", 
Description = {"Orang mengatakan bahwa The Sapha dari Manuk telah datang berkunjung. Aello mempercayai saya sehingga dia menunjuk aku, dan delegasi berada dalam ruang di bagian kanan di lantai dua. "}
, Summary = "bertemu di Sapha\'s delegation"}
, 
[7183] = {Title = "Undangan dari Sapha", 
Description = {"Vyhannus adalah Sapha yang datang dari El Dicastes, ibukota Sapha. Ravail dari Safa membuka ibukota untuk Manusia yang diundang resmi. Pertama, memerlukan ijin dari Avalanche, the General Guard at Manuk, untuk melewati terowongan"}
, Summary = "Bertemu Avalanche di Manuk"}
, 
[7184] = {Title = "El Dicastes!", 
Description = {"Mendapat persetujuan dari Avalanche untuk memasuki terowongan antara Manuk dan Ibukota, El Dicastes. Akhirnya dapat memasuki Ibukota dari Sapha!! "}
, Summary = ""}
, 
[7185] = {Title = "Inspector Doha", 
Description = {"Sebelum meninggalkan ibukota, Captain Hiba Agiff mengatakan kepada saya untuk bertemu Inspector Doha. Saya tidak tahu untuk apa, tetapi harus bertemu orang ini sebelum menuju Manuk Doha di ruang sebelum Vyhannus\'."}
, Summary = "Bertemu Inspector Doha"}
, 
[7186] = {Title = "Permintaan Rahasia Doha - Investigation ", 
Description = {"Doha mengatakan dia mencari tersangka dari laporan kasus pencuri tersebut. Dia diam-diam menyuruhku menyuruhku untuk mengumpulkan informasi ketika di El Dicastes, memberitahukan pakaian yang dipakai tersangka. Tersangka adalah seorang pria dengan menggunakan telinga hewan."}
, Summary = ""}
, 
[7187] = {Title = "Permintaan Rahasia Doha - Shay", 
Description = {"Shay adalah manajer \'Burman Flone\', Pub El Dicastes. Dia menyarankan untuk mendapatkan beberapa informasi tentang \'pria dengan telinga binatang\' dari Saphas yang tinggal di ibukota. "}
, Summary = "Lakukan beberapa percakapan dengan Saphas untuk mendapatkan informasi"}
, 
[7188] = {Title = "Pengumpulan Informasi - in the Plaza", 
Description = {"Telinga kucing ?bukan pedagang kucing ? Saya tidak tahu. Apakah kamu sudah bertemu dengan Ahat ? Dia benar-benar tampan dan terhormat."}
, Summary = ""}
, 
[7189] = {Title = "Pengumpulan Informasi - in the Factory", 
Description = {"Seorang Pria dengan telinga kucing? Aku belum pernah mendengarnya. Jangan mencoba untuk mencari sesuatu yang tidak masuk akal dan pergilah untuk bertemu dengan Ahat. Dia sangat tampan! Dia adalah model dari Sapha!"}
, Summary = ""}
, 
[7190] = {Title = "Pengumpulan Informasi - at the Guards", 
Description = {"Telinga kucing? Kamu yakin? Apakah ada manusia yang seperti itu ? Mengapa kamu tidak mencoba untuk bertemu dengan Ahat. Dia adalah Sapha yang sangat kuat. Mungkin dia banyak berkerja di tumpukan dokumen-dokumen  tapi dia pasti menyembunyikan kekuatannya!!"}
, Summary = ""}
, 
[7191] = {Title = "Shay\'s designation - BK", 
Description = {"Dalam rangka membantu mengumpulkan Informasi, Shay memperkenalkan BK dari Cat Merchants. Saya memberitahu BK bahwa ^4d4dff\'Minuman spesial Shay akan segera dikirimkan\'^000000 jika BK tidak membantunya.. "}
, Summary = "Bertemu BK"}
, 
[7192] = {Title = "BK\'s Information", 
Description = {"Menurut informasi BK, Manusia bertelinga kucing sangat dekat dengan Ahat, pria yang populer di ibukota Sapha. Tapi dia bilang Ahat bukan Sapha dan ditemukan di dekat Crack. Apa hubungannya dengan Crack ?"}
, Summary = "Mendiskusikannya dengan Shay"}
, 
