, 
[7425] = {Title = "Rumor tentang Raja 3", 
Description = {"Menghubungkan antara kesewenangan Cenes dan Kardui bisa dilakukan dengan berbicara pada Laphine. Sebenarnya ini tidak terlalu serius, tapi dapat dipastikan kalau Raja Kardui saat ini sangat mirip dengan Cenes."}
