, 
[7426] = {Title = "Rumor tentang Raja 4", 
Description = {"Belakangan ini, Kardui seepertinya telah menjadi Mayor Jun di dalam kekacauan yang dihadapi oleh seluruh ras Laphine. Mereka seperti setuju dengan kebijakannya, tapi mereka juga tampak tidak setuju dengannya."}
, Summary = ""}
, 
[7427] = {Title = "Disaat seperti ini, hadapi tanpa ragu!", 
Description = {"Kebenaran di balik kecemasan dan ketakutan Laphine terhadap Kardui tidak bisa dijelaskan. Bukankah ini sebaiknya disampaikan kepada masing-masing individu? Mungkin kamu bisa mendengar tentang alasan dibalik semuanya.."}
, Summary = "Bicaralah dengan Kardui."}
, 
[7428] = {Title = "Yai dari alam liar", 
