, 
[7431] = {Title = "Pengantar surat tidak pernah istirahat!", 
Description = {"Surat harus dikirim secara berkala. Ayo periksa lagi nanti."}
, Summary = "Temui Roy setelah beberapa waktu."}
, 
[7432] = {Title = "Pengacau di Dataran Bunga", 
Description = {"Ayo kita tunjukkan siapa yang berkuasa kepada Menblatt dan Petal yang mengganggu penjelajah."}
