, Summary = "Kirim suratnya."}
, 
[7435] = {Title = "Saatnya membaca surat", 
Description = {"Hisie meminta waktu untuk membaca suratnya. Hanya membutuhkan beberapa menit, sebaiknya kamu tunggu sebentar."}
, Summary = "Tunggu sampai dia selesai membaca suratnya."}
, 
[7436] = {Title = " Avant sang Magic Scholar", 
Description = {"Dalam surat Kardui, bukan hanya terdapat perkenalan. Tapi juga permintaan untuk mencari ayahnya, Avant sang Magic Scholar. Bantu Hisie untuk mencaritahu tentang scholar itu dari dalam Eclage."}
, Summary = ""}
, 
[7437] = {Title = "Permintaan Shenime", 
Description = {"Tidak bisa mendapatkan informasi tentang Avant tapi sebaliknya mendapatkan permintaan dari Shenime. Dia meminta mengumpulkan bahan eksperimen untuk magic scholar yang dia sponsori. Bahannya adalah 10 Dust Ball, 10 Leaf Bookmark."}
, Summary = "10 Dust Ball, 10 Leaf Bookmark."}
, 
[7438] = {Title = "Sponsor rahasia", 
Description = {"Shenime tidak memberitahu sedikitpun tentang magic scholar yang dia sponsori, dia juga meminta untuk melupakan pencariannya. Apakah ada orang yang mengetahuinya?"}
, Summary = "Cari informasi."}
, 
[7439] = {Title = "Magic scholar yang disponsori oleh Shenime", 
Description = {"Hisie mengatakan kalau kamu melacak Shenime, mungkin lokasi dari scholar akan diketahui. Cari tahu pekerjaan Shenime."}
, Summary = "Cari informasi."}
, 
[7440] = {Title = "Kesaksian Minuel", 
Description = {"Penjaga Eclage Minuel mengatakan kalau Shenime sering pergi ke timur, ke arah berlawanan dari Yai. Diskusikan masalah ini dengan Hisie."}
, Summary = "Bicaralah dengan Hisie."}
, 
[7441] = {Title = "Suratnya sudah tiba!", 
Description = {"Berencana untuk mengunjungi magic scholar Yai seolah-olah Shenime yang mengirim suratnya. Hisie akan memastikan apakah orang itu Avant atau bukan. Hisie akan memberikan informasi di persimpangan jalan di depan Eclage."}
, Summary = "10 Dustball, 10 Leaf Bookmark"}
, 
[7442] = {Title = "Identitas dari magic scholar", 
Description = {"Magic scholar tersebut ternyata memang Avant. Kamu harus memberitahu hal ini kepada Kardui."}
, Summary = "Bicaralah dengan Kardui."}
, 
[7443] = {Title = "Mengganggu penelitian!", 
Description = {"Kardui dan Hisie ingin tahu apa yang diteliti oleh Avant dan ingin mengganggunya. Apakah ini adalah balas dendam dari kedua bersaudara tersebut?"}
, Summary = "Mengganggu penelitian Avant."}
, 
[7444] = {Title = "Yang diteliti oleh Avant", 
Description = {"Avant sedang meneliti metode untuk mengekstrak kekuatan magic Orb. Karena ini adalah informasi berbahaya, materi penelitiannya harus dikembalikan secepatnya kepada Kardui."}
, Summary = "Kirimkan materi penelitiannya kepada Kardui."}
, 
[7445] = {Title = "Sosok dibalik Avant", 
Description = {"Cari tahu kekuatan dibalik penelitian Avant tentang Orb. Kemungkinan besar tersangkanya adalah sponsor Avant, sang kepala staf. Temui kepala staf untuk mengungkap kebenarannya."}
, Summary = "Bicaralah dengan kepala staf."}
, 
[7446] = {Title = "Pembicaraan tanpa hasil", 
Description = {"Setelah berbicara dengan Shenime sang kepala staf, kamu tidak mendapatkan apapun. Dia mengatakan bahwa dia juga mungkin telah ditipu oleh Avant. Kepala staf sebenarnya marah mengetahui Kardui hanya meningkatkan pertahanan disekitar Orb."}
, Summary = "Laporkan kepada Kardui."}
, 
[7447] = {Title = "Dilema disekitar Orb", 
Description = {"Hanya menegaskan ketidakpercayaan terhadap Kardui bukannya mengungkapkan lebih lanjut tentang penelitian Avant. Kepala staf berharap kalau penilaian Kardui tidak melemah dan meminta agar dia menunjukkannya."}
, Summary = "Laporkan kepada Kardui."}
, 
[7448] = {Title = "Ada yang tidak beres", 
Description = {"Setelah berdiskusi dengan Kardui dan Hisie, diputuskan bahwa kepala staf adalah orang yang paling mencurigakan. Apa alasan di balik penolakannya terhadap tindakan Kardui kepada Orb?"}
, Summary = "Awasi kepala staf."}
, 
[7449] = {Title = "Godaan terhadap Orb", 
Description = {"Kepala staf memintamu pergi ke ruang cahaya Orb untuk mendiskusikannya. Aku memutuskan untuk membiarkan Kardui tahu tentang ini setelah memintanya untuk memberikan aku waktu untuk berpikir."}
, Summary = "Laporkan kepada Kardui."}
, 
[7450] = {Title = "Ruang cahaya Orb", 
Description = {"Aku tidak tahu kenapa kepala staf terus memintaku untuk masuk ke ruang cahaya Orb, tapi aku memutuskan masuk ke dalam untuk mencaritahu alasannya. Untuk sementara ini ikuti keinginannya."}
, Summary = "Ikuti permintaan kepala staf."}
, 
[7451] = {Title = "Penghianatan", 
Description = {"Semuanya sangat membingungkan. Monster yang berada di ruang cahaya bukanlah anak buah dari Raja Iblis. Mereka mengendalikan diriku tanpa aku ketahui. Shenime sang kepala staf telah menghianati semua orang!"}
, Summary = "Laporkan kepada Kardui."}
, 
[7452] = {Title = "Cari kepala staf!", 
Description = {"Shenime sang kepala staf, yang bertanggung jawab atas semua kejadian ini telah bersembunyi. Menurut sumber dari Hisie, terdapat sisa-sisa kekuatan magic di Bifrost."}
, Summary = "Periksa Utara Bifrost."}
, 
[7453] = {Title = "Kepala staf yang terakhir", 
Description = {"Pergilah dari utara ke selatan di Bifrost. Sebelumnya itu merupakan jalan terbuka, tapi saat ini tertutup oleh celah besar di selatan. Mayat kepala staf telah ditemukan di jalan menuju celah tersebut."}
, Summary = "Laporkan kepada Kardui."}
, 
