Description = {"Iblis menyedot mana untuk mempertahankan kekuatan mereka. Anda telah memutuskan untuk kembali ke Avant setiap hari, untuk membantunya mengumpulkan Mana Crystallines."}
, Summary = "Tunggu satu hari."}
, 
[7593] = {Title = "Penaklukan Demon God", 
Description = {"Sudah waktunya untuk menyelesaikan pekerjaan: Mengalahkan Morroc di Temple of the Demon God."}
, Summary = ""}
, 
[7594] = {Title = "Frost Spider dan Fire Wolf", 
Description = {"Hilangkan ciptaan Morroc dan para pengikutnya: Frost Spider Brinaranea dan Fire Wolf Muspellskoll."}
, Summary = ""}
, 
[7595] = {Title = "Wandering Orb Magic", 
Description = {"Kumpulkan mana yang dicuri dari Yggdrasil dan Orb: pukul dan tebarkan Brilliant Mana, Life Mana, dan Earth Mana."}
, Summary = ""}
, 
[7596] = {Title = "Qualifications of the Guests", 
Description = {"Untuk memasuki Temple of the Demon God, Anda perlu kunci. Kalahkan Gatekeeper Ahat dan Shnaim, dan gunakan jiwa mereka untuk membuka pintu masuk kuil."}
, Summary = "1 Ahat\'s Soul, 1 Shnaim\'s Soul"}
, 
[7597] = {Title = "Fall of the False God", 
Description = {"Anda mengalahkan Demon God Morroc, yang ingin menciptakan dunia baru dan menjadi Tuhan. Laporkan ke Komandan Hiva Agip."}
, Summary = "Laporkan kepada Komandan."}
, 
[7598] = {Title = "Caged God", 
Description = {"Terkurung dalam dunianya sendiri, Demon God dikutuk untuk menderita selamanya. Kembalilah besok dan keluarkan dia dari kesengsaraannya sekali lagi."}
, Summary = "Kembalilah besok."}
, 
[7599] = {Title = "Unending Hunt", 
Description = {"Perburuan berlanjut sampai setiap Iblis di Temple of the Demon God dikalahkan. Ajudan Abidal meminta Anda untuk kembali ketika Anda sepenuhnya beristirahat."}
, Summary = "Kembalilah besok."}
, 
[7600] = {Title = "Besok Menjanjikan", 
Description = {"Orb dari Eclage dan Yggdrasil telah kehilangan sejumlah besar mana, dan dengan demikian pekerjaan pengumpulan mana berlanjut sampai sebagian besar diambil. Beristirahatlah dan kembali ke Hishieh sebelum Anda pindah ke Temple of the Demon God."}
, Summary = "Kembalilah besok."}
, 
