, Summary = ""}
, 
[7711] = {Title = "Permulaan", 
Description = {"Yo Ho! Aku adalah Doram yang paling terkenal di seantero dunia! Aku datang dari desa Lasagna, setelah berhasil menempuh perjalanan jauh melewati Gunung Ravioli. Dan akulah yang akan menguasai dataran Rune Midgard!"}
, Summary = "Berbicara dengan Ajena"}
, 
[7712] = {Title = "Dimanakah Aku??", 
Description = {"Yo Ho! Aku adalah Doram yang paling terkenal di seantero dunia! Apakah kamu ingin mengetahui rute menuju desa Lasagna? Vigilante Aglio akan memberitahumu."}
, Summary = "Berbicara dengan Aglio"}
, 
[7713] = {Title = "Pertempuran Pertama!", 
Description = {"Sudah kuduga! Vigilante Aglio ingin mengetes sejauh mana kemampuanku. Eggring tidak akan menjadi masalah bagiku!"}
, Summary = ""}
, 
[7714] = {Title = "Jus Apel Yang Menyegarkan", 
Description = {"Tidak ada yang lebih nikmat dan menyegarkan selain dari meneguk minuman manis yang dingin setelah bekerja. Vigilante Aglio tampaknya sangat memahamiku."}
, Summary = "Minum Jus Apel"}
, 
[7715] = {Title = "Kotak Yang Hilang", 
Description = {"Seorang anak dari kota mengatakan bahwa dia telah kehilangan kotak pengiriman. Sudah menjadi kewajibanku untuk menolongnya! Kalahkan Eggring untuk menemukan kotak itu. Temui Aglio setelah kamu berhasil menemukannya."}
, Summary = "Mengumpulkan Kotak Pengiriman"}
, 
[7716] = {Title = "Menuju Ke Desa!", 
Description = {"Setelah berhasil mengumpulkan kotak pengiriman, Vigilante Aglio memintaku untuk mengirimkannya kepada Kucing yang bekerja di Lasagna Tool Shop. Bagiku ini adalah suatu petualangan!"}
, Summary = "Berbicara dengan Kucing di Tool Shop"}
, 
[7717] = {Title = "Kebaikan Hati Pedagang", 
Description = {"Pemilik Tool Shop memberiku beberapa barang yang berguna, dan memintaku untuk menemui ^4d4dffHaru Sang Penyembuh^000000. Ia tinggal di ^4d4dffsebuah rumah berbentuk pot bunga, yang terletak di sebelah timur Tool Shop^000000."}
, Summary = "Berbicara dengan Haru Sang Penyembuh"}
, 
[7718] = {Title = "Akan Kugunakan Ini", 
Description = {"Pergi ke sebuah padang rumput di dekat desa, ambil ^4d4dffRed Grass^000000 dan ^4d4dff1 Red Herb^000000. Barang itu akan dibutuhkan untuk membuat obat."}
, Summary = "1 Red Herb"}
, 
[7719] = {Title = "Saatnya Mencerna", 
Description = {"Untuk membantu kucing yang berada di depan desa Lasagna mari kita lakukan beberapa pekerjaan. Ambil ^4d4dffRed Grass dan kumpulkan 2 buah Red Herb^000000. Ini akan jadi pekerjaan yang sangat mudah buatku!"}
, Summary = "2 Red Herb"}
, 
[7720] = {Title = "Panduan Penggunaan", 
Description = {"Mempelajari mengenai cara menggunakan gudang, dan menyimpan posisi."}
, Summary = ""}
, 
[7721] = {Title = "Kontes Kucing", 
Description = {"Perlombaan telah dimulai! Untuk memenangkannya kalahkan 3 Lunatic dan 2 Fabre secepat mungkin. Lunatic dan Fabre tampaknya dapat ditemui di sekitar sini."}
, Summary = "Kamu memiliki waktu 10 menit untuk mengalahkannya:"}
, 
[7722] = {Title = "EMT", 
Description = {"Mempelajari pengobatan medis darurat."}
, Summary = ""}
, 
[7723] = {Title = "Potensi Tersembunyi", 
Description = {"Mempelajari mengenai Status dan Ability. Bicaralah dengan Vigilante Nyoki untuk mengetahui hal ini lebih lanjut."}
, Summary = "Berbicara dengan Nyoki"}
, 
