, 
[8010] = {Title = "Ujian Pertama, sebuah Perjalanan", 
Description = {"Kamu harus melakukan perjalanan. Pertama, temui Rubalkabara yang ada di Timur laut reruntuhan Prontera. Kedua, Temui suster Mathilda didekat kota Morroc, Barat daya kota Prontera. Terakhir, Temui Bapa Yosuke disebuah field di barat laut Prontera."}
, Summary = "Ujian pertama, Sebuah perjalanan"}
, 
[8011] = {Title = "Ujian Kedua, Latihan Spiritual", 
Description = {"Pergi ke daerah ujian Spiritual berlangsung. Bicaralah kepada Peter S. Alberto."}
, Summary = "Ujian kedua, Latihan Spiritual"}
, 
[8012] = {Title = "Ujian Kedua, Latihan Spiritual", 
