[8017] = {Title = "Pemeriksaan Pabrik di kota Einbroch", 
Description = {"Jika kamu mau, Tolong periksa kontrol panel kedua yang agak rusak..."}
, Summary = "Periksa kontrol panel kedua"}
, 
[8018] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Tampaknya sudar rusak: Beberapa baut hilang, Dan penutup bajanya telah terbuka, memperlihatkan kabel yang semerawut."}
, Summary = "Laporkan kerusakan kepada Zelmeto."}
, 
[8019] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Ada 3 automatic pressure governors yang menempa dan membengkokan iron plates dari atas untuk membuat mereka lebih tipis. Nampaknya salah satu dari 3 benda itu ada yang rusak."}
, Summary = "Memeriksa automatic pressure governors."}
, 
[8020] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Ada suara menggiling yang aneh dan permukaan dari sekrup agak longgar."}
, Summary = "Laporkan keadaannya kepada Zelmeto."}
, 
[8021] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Aku ingin kamu memeriksa ^FF0000Kontrol panel^000000. Sama seperti yang kamu periksa sebelumnya, Tetapi lebih besar."}
, Summary = "Periksa kontrol panel."}
, 
[8022] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Setelah memeriksa lapisan luarnya, Kamu mendengar suara yang tidak enak. Nampaknya ada beberapa bagian yang hilang...."}
, Summary = "Laporkan keadaanya kepada Zelmeto."}
, 
[8023] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Mesin yang akan kau periksa sekarang lebih kecil. Pastikan kamu memeriksa mesin yang kecil, Karena kita juga punya alat alat berat di pabrik kita."}
, Summary = "Periksa Mesin yang berukuran kecil."}
, 
[8024] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Pergerakannya agak aneh, Lemah dan patah, Dan banyak sekrup nya yang berkarat."}
, Summary = "Laporkan keadaanya kepada Zelmeto."}
, 
[8025] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Sekarang, pipa yang kamu harus periksa berada di dekat Peleburan Metal disana. Kamu pasti dapat menemukannya dengan mudah."}
, Summary = "Periksa pipa."}
, 
[8026] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Pipa tersebut telah berkarat dan menyemburkan uap panas dibeberapa sisinya karena telah lama mengalami tekanan berlebih. Untunglah belum meledak pipanya."}
, Summary = "Laporkan kepada Zelmeto."}
, 
[8027] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Hal yang terakhir kamu lakukan adalah ^FF0000Alat dan mesin yang besar^000000. Sama dengan yang kamu periksa sebelumnya, Tetapi lebih besar dan lebih mantap."}
, Summary = "Periksa mesin yang berukuran besar."}
, 
[8028] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Alat alat pabrik ini nampaknya memiliki permasalahan yang sama dengan yang lainnya. Pergerakannya patah patah dan tidak lancar serta sekrupnya sudah berkarat dimana mana."}
, Summary = "Laporkan kepada Zelmeto."}
, 
[8029] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Terima kasih atas bantuanmu. Aku harus membuat perhitungan mengenai bahan bahan untuk memperbaiki ini semua. Pertama, Aku harus cepat membuat laporannya dan meminta untuk mdanor agar menaikan ongkos perbaikan mesin mesin ini"}
, Summary = "Permohonan kenaikan Biaya reparasi ."}
, 
[8030] = {Title = "Memeriksa Pabrik di kota Einbroch", 
Description = {"Apa...? Budget Biaya reparasi? Tidak akan! Buat apa buang buang uang? Lihat, Semuanya baik baik saja! Kenapa kamu mengkhawatirkan hal hal kecil?"}
, Summary = "Permohonan yang ditolak."}
, 
[8031] = {Title = "Perkerjaan untuk memperbaiki pabrik Einbroch", 
Description = {"Kita butuh 20 ^FF0000Flexible Tubes^000000, 10 ^FF0000Rusty Screw^000000 dan 10 ^FF0000Used Iron Plate^000000 untuk memperbaiki pabrik ini."}
, Summary = "Cari 20 Flexible Tubes, 10 Rusty Screw, 10 Used Iron Plate"}
, 
[8032] = {Title = "Permohonan Tarlock", 
Description = {"Aku mempunya adik yang jarang kutemui semenjak ia berlayar di Airship, ia seorang kapten kapal. Dapatkah kamu sampaikan surat ini kepada, Ferlock? Pastikan kau bawa balasan dari dirinya yach?"}
, Summary = "Sampaikan surat Tarlok kepada saudaranya."}
, 
[8033] = {Title = "Permohonan Ferlock", 
Description = {"Dia menjelaskan bahwa dia ingin untuk mengembalikan barang yang ia pinjam. Namun ia kehilangan barang-barang itu... bantu aku mencari ^FF0000 2 Will of the Darkness^000000 dan ^FF00002 Prickly Fruit^000000 ya?"}
, Summary = "cari 2 Will of the Darkness dan 2 Prickly Fruit kepada Ferlock."}
, 
[8034] = {Title = "Permhonan Ferlock", 
Description = {"Sampaikan surat ini kepada Tarlock untukku?"}
, Summary = "Antarkan surat Ferlock kepada kakaknya, Tarlock."}
, 
[8035] = {Title = "Antarkan surat kepada Tarlock", 
Description = {"Oh, Jadi kamu telah mengantarkan suratku? Bagus, kamu juga membawa balasannya. Hmm, Tunggu sebentar, Aku akan membaca surat ini dulu."}
, Summary = "Antarkan surat kepada Tarlock"}
, 
[8036] = {Title = "Permohonan Hallen", 
Description = {"Antarkan surat ini kepada Kaci untuk ku? Dari seseorang pria bernama Mr. Mawong, Gurunya atau siapa entah."}
, Summary = "Antarkan surat kepada Kaci."}
, 
[8037] = {Title = "Antarkan surat kepada Kaci", 
Description = {"Oh, Hallen pasti meminta mu mengantarkan ini. Dia pasti melakukan ini sendiri, tanpa bertanya kepada kostumernya! Jika kamu butuh bantuanku, minta saja?"}
, Summary = ""}
, 
[8038] = {Title = "Antarkan surat kepada Kaci Kaci", 
Description = {"Omong-omong, jika Hallen meminta tolong lagi padamu, tolak saja? Aku tidak akan ijinkan dia mengacau! Ho ho ho ho~"}
, Summary = ""}
, 
[8039] = {Title = "Rahasia dari Airships", 
Description = {"Airships ini sungguh besar dan megah, dan aku heran kenapa bisa terbang. Bagaimana mungkin? Coba kau caritahu hal ini untuk ku, yach, terima kasih yach."}
, Summary = ""}
, 
[8040] = {Title = "Rahasia dari Airships", 
Description = {"Benarkah...? Apakah kamu serius? Imitasi dari serpihan Ymir\'s Heart. Sepertinya aku pernah dengar? Mm, coba kupikir lagi.."}
, Summary = ""}
, 
[8041] = {Title = "Rahasia dari Airships", 
Description = {"Kaci pernah becerita tentang pemabuk yang selalu bercerita tentang Ymir\'s Heart ketika dia bermain dadu untuk sebuah apel!"}
, Summary = ""}
, 
[8042] = {Title = "Rahasia dari Airships", 
Description = {"Aku bertemu pria itu ketika membantu Shinokas. Dia adalah direktur dari laboratorium Einbroch mempunyai Ymir\'s Heart. Sebuah penyeledikan yang berharga..."}
, Summary = ""}
, 
[8043] = {Title = "Rahasia dari Airships", 
Description = {"Kamu bertanya tentang mekanis dari penerbangan Airship\'s flight. Karena kamu bukan staff disini... Lebih baik kau keluar dari sini. Penjaga selalu berpatroli didaerah ini, Jadi kamu hampir tertangkap. Hmm, temui aku di dalam Airship, Oke? Cepat ya!"}
, Summary = "Kamu harus temui Ferlock."}
, 
[8044] = {Title = "Tunangan Euslan\'s", 
Description = {"...Apakah kamu mau keluar dan mencari Thierry untukmu? Oh, terima kasih! Thierry pergi entah kemana, pergi naik salah satu Airships, untuk mencari obat untukku yang diberitahukan oleh dokter."}
, Summary = ""}
, 
[8045] = {Title = "Tips dari Kaci", 
Description = {"Ah, Aku akan bertanya kepada Kaptain kapal: Dia punya list penumpang dan daftar tujuan mereka."}
, Summary = "Memeriksa daftar penumpang dari list kapten kapal."}
, 
[8046] = {Title = "Daftar penumpang kapte Ferlock", 
Description = {"Dari daftar ini, dia terakhir mengambil Airship ke Hugel. itu saja."}
, Summary = ""}
, 
[8047] = {Title = "Permohonan Euslan", 
Description = {"Jika kamu ada waktu, kunjungilah saudaraku Eukran di Hugel, dan tanya kepadanya kemana kemungkinan Thierry pergi."}
, Summary = ""}
, 
[8048] = {Title = "Testimoni dari Eukran", 
Description = {"Lihat, Thierry kemari sebulan yang lalu, dan berkata ia mengunjungi kuil Odin. entahlah, Tetapi aku kira dia sedang membantu adik ku."}
, Summary = ""}
, 
[8049] = {Title = "Permohonan Thierry", 
Description = {"Aku tak bisa menjelaskan secara detil, Tetapi aku sedang mencari obat untuk penyakit Euslan. Tidak ada obat modern yang ampuh..."}
, Summary = ""}
, 
[8050] = {Title = "Bahaya pada Thierry", 
Description = {"Thierry Nampaknya dalam bahaya. Itulah kenapa ia jadi lama dalam pencarian obat ini. Kita harus membantunya sebelum terlambat."}
, Summary = ""}
, 
[8051] = {Title = "Obat untuk Euslan", 
Description = {"Aku harus menyelamatkan Euslan apapun yg terjadi. aku hanya butuh 5 Runes of the Darkness untuk menyelesaikan obat ini. Tolong bantu aku mencarinya..."}
, Summary = "Cari 5 Runes of the Darkness"}
, 
[8052] = {Title = "Permohonan Thierry", 
Description = {"Aku ingin bertemu dengan Euslan tapi, aku harus menunggu sampai agen Rekenber berhenti mencariku. Berikan obat ini kepada Euslan Secepatnya: hidupnya bergantung pada obat itu."}
, Summary = "Antarkan obat kepada Euslan."}
, 
[8053] = {Title = "Permohonan Elreon", 
Description = {"Aku harap kamu dapat menemui anakku, Postell dan katakan padanya untuk membawa obat obatku! Pergilah ke timur, diluar kota, dan temui Postell."}
, Summary = ""}
, 
[8054] = {Title = "pesan dari Postell", 
Description = {"Aku akan menemui dia segera. Hey, maukah kau pastikan ayahku tidak melakukan hal hal yang membahayakan dia?"}
, Summary = "Kembali kepada Allen"}
, 
[8055] = {Title = "Menjaga Allen", 
Description = {"Bagaimana jika penyakit ku kambuh sebelum Postell datang membawa obatku?! Aku mungkin bisa mati! Maukah kau menjagaku sebelum anakku datang?"}
, Summary = "Menjaga Allen."}
, 
[8056] = {Title = "Sebuah hadiah kecil", 
Description = {"Silahkan lihat didalam laci obat itu, Dan ambil apa saja yang kau butuhkan~"}
, Summary = "LIhat kedalam laci obat."}
, 
[8057] = {Title = "Rungutan Manainne", 
Description = {"Pohon ini sungguh berarti bagi semua orang di kota ini, dan kita mempunyai memori indah. tetapi El Schatt fellow berencana memnebangnya untuk membangun tokonya..."}
, Summary = ""}
, 
[8058] = {Title = "Pembicaraan dengan El Schatt", 
Description = {"Lihat, Kenangan itu indah, Tetapi aku tidak begitu perduli masa lalu. Aku juga punya kenangan disini, Tapi kau tahu? Aku putuskan untuk membuangnya sebelum begitu menyakitkan. Itulah hidup. Ayahku sejak dahulu ingin membangun toko disini, Dan kurasa ini saatnya."}
, Summary = ""}
, 
[8059] = {Title = "Perbincangan dengan Perfitz", 
Description = {"Aku senang akhirnya anakku berpikiran untuk melanjutkan bisnis keluarga. Tapi lucu... dia begitu kekeh untuk membangun toko ditempat pohon itu berdiri. Aku rasa sesuatu sedang terjadi, seperti dia yang terlalu bersemangat untuk menebang pohon tersebut. Orang tua ini mungkin terlalu curiga~"}
, Summary = ""}
, 
[8060] = {Title = "El Schatt yang keras kepala", 
Description = {"Benar bila aku berbeda pendapat dengan yang lain... Aku ingin melindungi pohon itu dengan hidupku, aku tidak memungkirinya. tetapi itu cerita lama yang sudah usang.."}
, Summary = ""}
, 
[8061] = {Title = "Gerutuan Manainne", 
Description = {"Sekarang El Schatt Sudah tidak mempunya hati, hanya berpikir tentang uang...! dia telah berubah. Adik perempuanku pasti sedang sedih dikuburannya, melihat ia yang sekarang..."}
, Summary = ""}
, 
[8062] = {Title = "Arwah dari Kanainne", 
Description = {"Aku... Aku dapat meminjam tubuh adikku? Ya, Jika dia mau berkerja sama, mungkin... mungkin akan berhasil. Au harus... Aku harus melakukan seseuatu sebelum dia... dia... dia menyakiti dirinya lebih jauh..."}
, Summary = "Kembali ke Hugel"}
, 
[8063] = {Title = "Kanainne bertemu dengan El Schatt", 
Description = {"...El Schatt... Dengarkan aku. lihat aku. Aku adalah Kanainne mu. Kamu tulis lagu ini untukku. tetapi aku mati sebelum kau menyelesaikannya."}
, Summary = ""}
, 
[8064] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Tolong antarkan Fish Cake Soup kepada temanku Neha. Dia adalah pelanggan tetap ku.."}
, Summary = "Antarkan pesanan kepada Neha."}
, 
[8065] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Pesanan berikutnya Fish Cake Soup kepada Maewan, Pelanggan setiaku juga."}
, Summary = "Antarkan pesanan kepada Maewan."}
, 
[8066] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Antarkan kepada teman sekamarku Layoma. Tetapi... berhati hatilah. dia sangat perhatian dengan waktu. Jangan telat ya..."}
, Summary = "Antarkan  pesanan kepada Layoma."}
, 
[8067] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Cepat antarkan Fish Paste Soup kepada Erjan. Tetapi hati2 ya, dia agak pemilih..."}
, Summary = "Antarkan pesanan kepada Erjan."}
, 
[8068] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Kamu telat! Apakah kamu tidak tahu kalau soup tidak baik jika tidak disantap panas? Tetapi... kamu orang yang ganteng, Jadi kamu kumaafkan... Dengan satu sarat. Bawakan aku ^FF00001 Whip^000000 Untuk mencambukmu. Cepat yach ganteng ^^."}
, Summary = "Bawakan sebuah Whip Kepada Neha."}
, 
[8069] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Kamu telat! Ini salahmu, Kamu tahu, Kan? Aku bisa memaafkanmu jika membawakanku sebuah Bookclip in Memory, Ok?"}
, Summary = "Bawakan Maewan 1 buah Bookclip in Memory."}
, 
[8070] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Aku tidak dapat mebiarkan Cellette memperkerjakanmu Paling tidak kau harus beguna untukku. Erm, Bawakan aku ^FF00001 Mushroom Spore^000000, Dan aku akan melupakan hal ini."}
, Summary = "Bawakan 1 Mushroom Spore Kepada Layoma."}
, 
[8071] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Bawakan aku ^FF0000Fish Cake Soup^000000 Dengan ^FF00001 China^000000 Jadi aku dapat lebih nikmat makannya"}
, Summary = "Bawakan 1 China kepada Erjan."}
, 
[8072] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Aku puas. Aku akan bilang kepada Celette kerja mu bagus... Aku harap kamu mengantarkan soupku lagi lain waktu~."}
, Summary = "Kembali pada Cellette."}
, 
[8073] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Bagus, kamu membawakan Bookclip of Memory, ini akan menjadi tambahan yang berharga bagi koleksiku~ Oh ya, mana sup-ku, terima kasih sudah mengantarkannya~"}
, Summary = "Kembali pada Cellette."}
, 
[8074] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Baiklah, mungkin aku bisa mengandalkanmu untuk bekerja pada Cellette. Oh, dan katakan padanya supaya tidak pulang larut malam setiap hari, oke?."}
, Summary = "Kembali pada Cellette."}
, 
[8075] = {Title = "Cellette\'s Fish Cake Soup", 
Description = {"Terima kasih atas Paket yang kau bawakan~"}
, Summary = "Kembali pada Cellette."}
, 
[8076] = {Title = "Klitzer dan Calla", 
Description = {"Aku tahu aku akting seperti orang idiot. tetapi aku akan melakukan apapun agar dapat bertemu Calla... Jangan dengarkan apa yang kukatakan. Aku hanya orang miskin yang jatuh cinta dengan orang yang salah....."}
, Summary = ""}
, 
[8077] = {Title = "Klitzer dan Calla", 
Description = {"Mungkin aku tak dapat melihatnya, Tapi tolong berikan violin kepada Klitzer untukku? Aku terbiasa memaikan musik dengan ini untuknya..."}
, Summary = "Ambil Violin Calla dan serahkan kepada Klitzer."}
, 
[8078] = {Title = "Klitzer dan Calla", 
Description = {"Itu adalah Violin putriku. Aku memberikannya pada ulangtahun ke 16nya... Kamu sudah keterlaluan! Penjaga! Penjaga!"}
, Summary = "Calla\'s Violin diambil alih."}
, 
[8079] = {Title = "Klitzer dan Calla", 
Description = {"Yang kamu lakukan sekarang adalah serhakan ^FF00001 Tangkai bunga^000000. dan aku tidak punya zeny serta aku pasti tidak disambut di daerah Kapellthaine Manor."}
, Summary = "berikan 1 bunga kepada Calla."}
, 
[8080] = {Title = "Klitzer dan Calla", 
Description = {"Oh, jika kamu lewat Einbroch, ucapkan terima kasih kepada Klitzer atas bunganya untukku? Dan... dan... katakan padanya aku kangen dia."}
, Summary = "Sampaikan pesan Calla\'s kepada Klitzer."}
, 
[8081] = {Title = "Klitzer dan Calla", 
Description = {"Aku merasa baikan sekarang, Oh iya, kenapa kau tidak menemui ibuku? Dia suka bertemu dengan teman teman ku."}
, Summary = "Temui ibunda Klitzer."}
, 
[8082] = {Title = "Klitzer dan Calla", 
Description = {"Aku tidak dapat melihat keadaan kota ini yang saling bertentangan serta tidak memperbolehkan orang yang saling mencintai bertemu..."}
, Summary = ""}
, 
[8083] = {Title = "Klitzer dan Calla", 
Description = {"Carikan aku ^990000Coals^000000? pasti mudah untukmu."}
, Summary = "Bawakan Coals untuk Satra."}
, 
[8084] = {Title = "Klitzer dan Calla", 
Description = {"Aku akan mencari kegunaanya dulu. Aku takut hadiah ini tidak begitu berguna. Bagaimana Coal Biasanya digunakan? Ah, aku tidak punya ide!"}
, Summary = "Bawakan Coals kepada Satra."}
, 
[8085] = {Title = "Klitzer dan Calla", 
Description = {"Ketika kamu bertemu Klitzer, katakan padanya untuk menemuiku segera. Oh, dan ingatkan dia untuk berbusana yang pantas dan rapi. Ho ho ho ho ho~!"}
, Summary = "Sampaikan pesan kepada Klitzer."}
, 
[8086] = {Title = "Klitzer dan Calla", 
Description = {"Eh...?  Apa katamu? Ibu Calla ingin minum teh bersama ku? Sungguh keajaiban...!!"}
, Summary = ""}
, 
[8087] = {Title = "Klitzer dan Calla", 
Description = {"Terima kasih untuk membantu anakku, Klitzer. Sedihnya, dia tidak mengerti bagaimana memilih baju yang pantas. Seorang pria harus mengenakan formal suit atapupun tuxedo, Untuk acara khusus seperti itu."}
, Summary = "Carikan Klitzer baju yang bagus."}
, 
[8088] = {Title = "Klitzer dan Calla", 
Description = {"Kamu telah membuka mataku. Mulai sekarang, Aku akan berusaha mendapatkan restu dari orang tua Calla dan pantas bagi cintanya."}
, Summary = ""}
, 
[8089] = {Title = "Gemstone yang dicuri", 
Description = {"Aku tidak punya bukti, Tapi aku mencurigai Phobe, pelayan yang hilang pada saat kejadian. Coba cari tahu dari pelayan yang lain."}
, Summary = "Cari tahu tentang keberadaan Phobe."}
, 
[8090] = {Title = "Gemstone yang dicuri", 
Description = {"Aku berkata jujur, aku tidak tahu apa apa karena masih baru disini. Kenapa kau tidak tanyakan pada pelayan yang senior? Coba kau tanya Mr. Manson didalam mansion."}
, Summary = "Temui Mr. Manson."}
, 
[8091] = {Title = "Gemstone yang dicuri", 
Description = {"Ah, tukang kebun kami, Jenny yang mengenalkan aku kepadanya. dia berkerja untuk Sir Zhed untuk waktu yang lama, dan Dia suka anak anak. Coba kau tanyakan kepada Jenny."}
, Summary = "Temui Jenny"}
, 
[8092] = {Title = "Gemstone yang dicuri", 
Description = {"Baiklah aku pikir aku dapat pergi ke pasar dan bertanya tanya."}
, Summary = "Pergi ke pasar."}
, 
[8093] = {Title = "Gemstone yang dicuri", 
Description = {"Tadi malam, Seseorang bertanya padaku tentang Phobe. Dia berpesan agar datang ke \'ice cave.\' Namanya adalaha.. Logan? Nogan? hogan? cogan? Entahlah."}
, Summary = "Pergi ke Ice Cave."}
, 
[8094] = {Title = "Gemstone yang dicuri", 
Description = {"Instruksi Vincent adalah bunuh siapapun yang bertanya tentang Rogan, Nama yang ia buat. Nampaknya dia menipu kita. Maaf, seandainya saja aku tahu"}
, Summary = "kembali ke Vincent."}
, 
[8095] = {Title = "Gemstone yang dicuri", 
Description = {"Kamu tidak akan ada dalam masalah jika aku berhasil menemukan permata itu dan Phobe Sebelum Sir Zhed kembali, aku akan mencarinya secepatnya."}
, Summary = "Mencoba mencari Phobe."}
, 
[8096] = {Title = "Gemstone yang dicuri", 
Description = {"Seperti yang kamu ketahui, Aku tidak berencana untuk pulang, Tidak sama sekali. Tapi katakan pada ibuku bahwa aku baik baik saja."}
, Summary = "Kembali ke Vincent."}
, 
[8097] = {Title = "Gemstone yang dicuri", 
Description = {"ketika aku kembalikan permata ini, tolong katakan pada istriku Jenny bahwa anaknya baik baik saja? dia sungguh khawatir terhadapnya, ya..."}
, Summary = "Sampaikan salam anaknya kepada Jenny."}
, 
[8098] = {Title = "Gemstone yang dicuri", 
Description = {"Terima kasih atas bantuanmu, Petualang~"}
, Summary = "kembali kepada Vincent."}
, 
[8099] = {Title = "Gemstone yang dicuri", 
Description = {"Surat ini adalah surat rekomendasi yang kubuat. antarkan ini kepada Sir Zhed Secepatnuya. Terimakasih atas segalanya."}
, Summary = "Temui Sir Zhed."}
, 
[8100] = {Title = "Rekomendasi dari High Priest Zhed", 
Description = {"Ketika aku mengerjakan surat rekomendasi ini, Aku akan beritahukan dimana kantor resmi pope tempat kamu pergi setelah kamu mengumpulkan 40 buah Glacial Hearts."}
, Summary = "Cari 40 Glacial Hearts dan temui Pope."}
, 
[8101] = {Title = "Rekomendasi dari High Priest Zhed", 
Description = {"Aku berterimakasih kepadamu. Waktuku jadi berharga. Sekarang aku harus pergi dulu.."}
, Summary = "Kembali menemui Zhed."}
, 
[8102] = {Title = "Rekomendasi dari High Priest Zhed", 
Description = {"maaf, Tapi kita belum selesai berdiskusi. Sementara itu silahkan kamu beristirahat di ruang sebelah?"}
, Summary = ""}
, 
[8103] = {Title = "Rekomendasi dari High Priest Zhed", 
Description = {"Aku menyarankan padamu. jangan terlalu dekat dengan High Priest Zhed. Jika tidak maka kamu bisa terkena dalam masalah..."}
, Summary = "Kembali Zhed."}
, 
[8104] = {Title = "Rekomendasi dari High Priest Zhed", 
Description = {"Ah, Sebelum kamu pergi aku beritahu jangan ^FF0000mendekati area HOLY GROUND^000000. kuulangi, Menjauhlah."}
, Summary = ""}
, 
[8105] = {Title = "Rekomendasi dari High Priest Zhed", 
Description = {"Aku memperingati Bekento jika ia dapat menjadi masalah untukmu, Tampaknya kamu sudah membuat masalah untuknya. PAhami ini: Penyusup akan dihukum, tetapi karena persahabatanku dengan Bekento, aku memaafkanmu...."}
, Summary = "kembali menemui Zhed."}
, 
[8106] = {Title = "Keberadaan Bruspetti", 
Description = {"Aku baru tahu bahwa putriku pergi dengan seseorang. Dia pergi keluar kota untuk bertemu dengannya, Dan aku tidak tahu apapun darinya!!."}
, Summary = "Temui Lachellen."}
, 
[8107] = {Title = "Pernyataan Lachellen", 
Description = {"Ooh, aku cemburu kepada Bruspetti!Dia menghabiskan waktu dengan pacar barunya... tapi dia merahasiakan namanya dariku. Aku cuma tahu dia tinggal di Lighthalzen? itu saja."}
, Summary = "Cari orang asing di kota."}
, 
[8108] = {Title = "Pendatang asing, Katinshuell", 
Description = {"Geez... Kalian berusaha memecahkan masalah, Tapi kamu tidak dapat menangani ini. Aku dan pacarku merupakan sebuah sejarah. Sudah habis cerita itu."}
, Summary = "kembali kepada Mr. Shendar."}
, 
[8109] = {Title = "Wewangian Bruspetti", 
Description = {"Aku rindu putriku. YA, RUmah ini jadi hampa tanpanya. Aneh memang, Namun wewangian Bruspetti sungguh khas, Sama seperti ibunya."}
, Summary = "Cari wewangian yang dikenakan Bruspetti di Lighthalzen."}
, 
[8110] = {Title = "Wewangian Bruspettit", 
Description = {"Wangi ini.....Wangi... Sungguh harum! Seperti kelopak bunga mawar yang merekah... Tunggu, Apakah ini wewangian yang ayah Bruspetti jelaskan?"}
, Summary = "Kembali ke Rachel dan temui Lachellen."}
, 
[8111] = {Title = "Pengakuan Lachelleny", 
Description = {"Jika dia di Lighthalzen, dia kesana pasti untuk mengenal lebih jauh pacarnya. Hmm, mungkin kamu dapat memeriksa tempat mereka bertemu, coba kamu periksa disana."}
, Summary = "Cari kolam Freya\'s Spring."}
, 
[8112] = {Title = "Mata Air Freya", 
Description = {"Maaf menggangumu, tetapi permukaan tempatmu sekarang berpijak cukup licin."}
, Summary = "Kembali kepad Mr. Shendar."}
, 
[8113] = {Title = "Diary Bruspetti", 
Description = {"Sebagai ayah yang sayang, Aku tidak dapat membuka buku diarynya. Walaupun dia menaruhnya di atas laci."}
, Summary = "Cari diary diatas laci."}
, 
[8114] = {Title = "Diary Bruspetti", 
Description = {"Sebagai ayah yang sayang, Aku tidak dapat membuka buku diarynya. Walaupun dia menaruhnya di atas laci."}
, Summary = "Cari diary diatas laci."}
, 
[8115] = {Title = "Diary Bruspetti", 
Description = {"Ini pasti diary Bruspetti!! Tetapi... Membacanya akan membuatmu seperti orang yang tidak tahu malu. jadi jangan sentuh diary itu."}
, Summary = "Temui Katinshuell"}
, 
[8116] = {Title = "Katinshuell yang mencurigakan", 
Description = {"Aku beritahu kepadamu aku baru saja putus dengan pacarku . Aku sedang ingin sendiri. Pergi..."}
, Summary = "Temui Lachellen."}
, 
[8117] = {Title = "Pernyataan Lachellen", 
Description = {"Mata Air Freya ? Oh, Aku suka tempat itu! Ngomong2, aku kenal Katinshuell, Yang sering kesana. Biasanya laki laki tidak sendirian..."}
, Summary = "Pergi ke Mata Air Freya."}
, 
[8118] = {Title = "Mata Air Freya", 
Description = {"Lihat Pingiran dari mata air Freya? Laki laki yang sama biasanya berdiiri disitu, dan melihat kedalam air, Dan penuh dengan kesedihan."}
, Summary = "Kembali kepada Tuan Shendar."}
, 
[8119] = {Title = "Perbincangan dengan Mr. Shendar", 
Description = {"Tunggu, TUnggu... Jadi seseorang tengah menyelinap disini? Aneh. TUnggu, Orang itu, Mungkinkah pacarnya Bruspetti.."}
, Summary = "Gunakan Diari Bruspetti untuk menemukan Katinshuell."}
, 
[8120] = {Title = "Perbincangan dengan Katinshuell", 
Description = {"Katakan sejujurnya! Apa yang kau ketahui? Kenapa kita tidak mencari kebenarannya bersama? Bagaimana?"}
, Summary = "Perbincangan dengan Katinshuell."}
, 
[8121] = {Title = "Perbincangan dengan Katinshuell", 
Description = {"Dia masih menolak aku... Bagaimana aku bisa mengetahui kebenearannya? apakah ada yang bisa kugunakan untuk mengatakn perasaan ku ini..."}
, Summary = ""}
, 
[8122] = {Title = "Perbincangan dengan Katinshuell", 
Description = {"... Tinggalkan aku sendiri. Aku telah kehilangan wanita yang kucintai karena perbuataanku dahulu kala..."}
, Summary = "Pergi ke Mata Air Freya."}
, 
[8123] = {Title = "Ayotaya, Tom Yum Goong", 
Description = {"Semua orang dapat mebuat Tom Yum Goong, tetapi saya menyarankan untuk menemui ^3131FFMali the Spicy^000000. Dia adalah koki handal. Mengapa kamu tidak berbicara padanya untuk memasakannya untuk kamu?"}
, Summary = " "}
, 
[8124] = {Title = "Ayotaya, Tom Yum Goong", 
Description = {"Kamu dapat membeli Shrimp dari seorang laki-laki bernama, \'^3131FFThongpool^000000\'. Dapatkan 20 Shrimps untuk memasak Tom Yum Goong."}
, Summary = "Bawakan 20 shrimps kepada Mali the Spicy."}
, 
[8125] = {Title = "Ayotaya, Tom Yum Goong", 
Description = {"Mali the Spicy telah menemukan lemon yang sangat bagus di sekitar pohon lemon, namun, lemon tersebut tidak untuk dijual. Kamu harus mendapatkan lemon dari pemilik pohon lemon tersebut."}
, Summary = "Bawakan 10 lemons kepada Mali the Spicy."}
, 
[8126] = {Title = "Ayotaya, Tom Yum Goong", 
Description = {"Sekarang kamu harus mendapatkan \'^CE0000Chilli^000000\' dan bahan yang lain dari pasar. Berbicaralah pada pedagang di pasar dan kamu tahu bahan yang dibutuhkan."}
, Summary = "Bawakan 30 Chilli dan bahan lainnya kepada Mali the Spicy."}
, 
[8127] = {Title = "Momotaro", 
Description = {"Ketua berkata Dokebi memperoleh 20 juta zeny dengan membajak simpanan orang lainn... Sejak kami para penduduk menghabiskan waktu kami untuk duduk dan berbincang-bincang, kami tidak dapat membunuh Dokebis karena kami terlalu lemah, jadi...Tolong lakukan ini demi kami."}
, Summary = "Kalahkan Dokebi"}
, 
[8128] = {Title = "Momotaro", 
Description = {"Sekarang, Kisah Momotaro telah berakhir. Kamu dapat memperoleh hadiah ketika kamu berbicara kepada Publisher yang kamu lihat pertama."}
, Summary = " "}
, 
[8129] = {Title = "Momotaro", 
Description = {"..Kali ini saya diperintahkan untuk mengirim kamu kembali...Tetapi! Saya akan memberikan kamu kesempatan. Tetapi jika kamu gagal, ^3163FFkamu tidak dapat melanjutkan tantangan ini.^000000 Juga, misi ini akan sulit."}
, Summary = " "}
, 
[8130] = {Title = "Momotaro", 
Description = {"Kamu benar-benar luar biasa. Kamu telah menemukan gerakannya. Mari akan kutunjukan jalan keluarnya. Saya punya banyak waktu...Jangan lupa untuk mengambil hadiah kamu."}
, Summary = " "}
, 
[8131] = {Title = "Ibunda Raja Amatsu", 
Description = {"Ibu dari raja sedang beristirahat di sini. Dia telah sakit selama berbulan-bulan. Itulah mengapa dia berada di sini."}
, Summary = " "}
, 
[8132] = {Title = "Ibunda Raja Amatsu", 
Description = {"Kamu, yang diutus dari Rune Midgard, mungkin dapat menyembuhkan penyakit ibu saya. Saya akan memberikan hadiah apabila kamu berhasil.. Ibuku tinggal di sebuah rumah di luar kastil. Datanglah kepadaku apabila kamu telah berhasil menyembuhkannya."}
, Summary = "Cara obat untuk ibunda raja."}
, 
[8133] = {Title = "Lagu Siluman Rubah", 
Description = {"Priest, priest~ Sebuah rubah mengikuti saya! Apabila dia tidak pergi ketika saya berteriak dan memanggil! Kuil Priest di utara seharusnya membantu saya~ Ralralrah Ralralrah Ralralrahralralrah~~"}
, Summary = " "}
, 
[8134] = {Title = "Pemuda di Kuil Utara", 
Description = {"Sebuah Roh yang lebih kuat dapat menangkal rubah itu. Ayoo teriak dan tunjukkan keyakinanmu!"}
, Summary = " "}
, 
[8135] = {Title = "Mengusir Siluman Rubah", 
Description = {"^FF6060Yelp! Yelp! Yelp! Manusia! Dapat mengusir saya dari tubuh ini! Terkutuk kamu! Kurang ajar kamu! Saya akan kutuk seluruh keluarga Ishida, dan kamu lebih baik berhati - hati, manusia!^000000"}
, Summary = " "}
, 
[8136] = {Title = "Hutan yang berbahaya", 
Description = {"Banyak petualang telah tersesat di dalam hutan di depan kami. Tetapi jangan perdulikan saya. Saya tahu jalan disekitar sini dan saya tidak takut terhadap monsters."}
, Summary = " "}
, 
[8137] = {Title = "Batu nisan misterius", 
Description = {"Jika kamu pergi ke kanan, kamu akan menghilang, jika kamu pergi ke kiri, kamu akan kehilangan suara, jika kamu pegi ke depan, kamu tidak akan kemana-mana."}
, Summary = " "}
, 
[8138] = {Title = "Peringatan Gray Wolf", 
Description = {"... Kembaliah, petualang... Disini bukan tempatmu. Dia tidak ingin manusia berkeliaran di sekitar hutan.  Koshei.. Dia itu kebal dan setan terjahat."}
, Summary = " "}
, 
[8139] = {Title = "Permohonan Gray Wolf", 
Description = {"Saya perlu orang yang berani, seperti kamu, untuk membantu saya. Disini adalah tempat yang tidak baik. Naik ke belakangku, Saya akan menunjukkan sesuatu."}
, Summary = " "}
, 
[8140] = {Title = "Maria Morebna ", 
Description = {"Pertama-tama, Kamu perlu mengeluarkan dia dari sana. Saya mendengat tentang \'^0000ffGolden Key^000000\' yang membuka apapun. Pembuat kunci itu ada di dalam desa tersebut. Saya ingin kamu mencari dan tanyakan tentang \'^0000ffGolden Key^000000\'."}
, Summary = "Temukan pembuat kunci di Moscovia."}
, 
[8141] = {Title = "Blacksmith di Moscovia", 
Description = {"Saya satu-satunya yang mengetahui bagaimana cara menbuat ^0000ffGolden Key^000000\'. Apa kamu kira mengunakan Golden Key terasa nyaman mudah? Sebenarnya, Itu tidak benar. Sangat sukar dalam membuat dan mngumpulkan bahan-bahan untuk membuat kunci itu. Ok, Pertama-tama, cari ^0000ff25 Steels^000000."}
, Summary = "Berikan ke dia 25 Steels."}
, 
[8142] = {Title = "Golden Key", 
Description = {"Kamu memerlukan ^0000ff2 Cursed Ruby, 3 Gold, 1 Red Ring, 2 Lusalka\'s Hair, 10 Golden Thread^000000 untuk membuat kunci."}
, Summary = "bawakan 2 Cursed Ruby, 3 Gold, 1 Red Ring, 2 Lusalka\'s Hair, 10 Golden Thread kepada blacksmith di Moscovia"}
, 
[8143] = {Title = "Cincin Merah Bassili", 
Description = {"Saya memberikan cincin merah kepada adik bungsu perempuan saya, Mashenka, sebagai hadiah. Dan dia meninggal... Saya hanya mempunyai anak perempuan yang lebih tua, Ryubaba. Dia juga cantik, pintar dan sangat disayang, tetapi saya tidak dapat meringankan kesedihan atas kehilangan anak perempuan.."}
, Summary = " "}
, 
[8144] = {Title = "Keberadaan Mashenka", 
Description = {"Ayahku memberikan itu kepada pengasuhku, Mashenka. Saat, dia pergi ke jalan-jalan dan menghilang di sekitar rawa. Kami mencoba untuk mencarinya tetapi kami tidak menemukannya dan cincin tersebut. Saya berfikir bahwa dia lari dengan cincin itu.."}
, Summary = " "}
, 
[8145] = {Title = "Keberadaan Mashenka", 
Description = {"Saya mendengar sesuatu tetapi saya tidak ingat.. Kamu sebaiknya pergi ke sekitar rawa-rawa untuk menemukan sesuatu? kamu dapat menemukan Pointed Tree di sekitar rawa-rawa. Bisakah kamu mengambil ^0000ff50 Pointed Branches^000000?"}
, Summary = "Bawakan 50 Pointed Branches kepada Shepherdess"}
, 
[8146] = {Title = "Pointed Wooden Flute", 
Description = {"Apa, apa-apaan ini? Mengerikan! Kenapa seruling ini mengeluarkan suara ini!? Saya tidak pernah melihat ini sebelumnya! Saya merasa tidak enak! kamu ambil ini!"}
, Summary = ""}
, 
[8147] = {Title = "Pointed Wooden Flute", 
Description = {"Saya tidak mau menukar ini dengan cincin itu! Saya harus membiarkan ayahmu untuk mengetahui apa yang terjadi sebenarnya! Saya akan pergi ke dia dan menceritakan hal ini! Kamu berlakulah jujur dan akan dihukum!"}
, Summary = "Laporkan pada Bassili"}
, 
[8148] = {Title = "Dissappointed Lady", 
Description = {"Apakah kamu pernah pergi ke rawa-rawa di Moskovia? Apakah kamu melihat anak perempuanku?? Saya tidak perduli apabila dia berubah menjadi Lusalka. Saya ingin mengetahui dimana ia berada."}
, Summary = ""}
, 
[8149] = {Title = "Dissappointed Lady", 
Description = {"\'^0000ffHoly Water Disukai oleh Tuhan^000000\' akan melindungi kamu dari Lusalka. dan Lusalka itu mahkluk malam hari. ^ff0000dari jam 11 malam hingga jam 5 pagi^000000, kamu dapat denganmudah menemukannya. Tolong, Investigasi dimana anak perempuanku berada. Tolonglah."}
, Summary = "Temukan dimana anak perempuan tersebut berada"}
, 
[8150] = {Title = "Lusalka\'s Lover", 
Description = {"Dimalam ketika dia pergi, lusalka berkata bahwa dia akan ke ibukota dari rune Midgarts. Saya tidak yakin apabila dia masih disana atau tidak... namanya adalah \'^0000ffIgor^000000\'. Ah, Berikan cincin ini kepadanya. Dia memberikan kepadaku untuk hadiah."}
, Summary = "Temukan Igor"}
, 
[8151] = {Title = "Petualang dari daerah asing", 
Description = {"Itu adalah dia yang datang bersam-samadengan saya dari Moskovia. Saya datang kesini dengan dia tetapi terpisah darinya beberapa hari yang lalu. Sepertinya dia pergi mengembara karena tidak dapat melupakan kekasihnya. Dia memberitahukan kepada saya bahwa dia ingin untuk bepergian ke sebuah padang gurun.."}
, Summary = "Temukan Igor"}
, 
[8152] = {Title = "Penduduk di Morroc", 
Description = {"Ah, Apakah kamu berbicara tentang seseorang dengan pakaian yang aneh dan mood yang buruk? Aksennya yang aneh membuat saya berfikir bahwadia bukan dari Rune Midgarts.. Dia pernah berada beberapa hari yang lalu tetapi dia berangkat untuk melihat piramid. Saya tidak pernah melihatnya lagi setelah itu."}
, Summary = "Temukan Igor"}
, 
[8153] = {Title = "Pesan Igor", 
Description = {"Bisakah kamu pergi kepadanya dan memberitahu pesan saya? Sebelum bulan purnama, Saya akan kembali ke Moscovia dan bertemu dengannya. Saya akan menjadi sangat kuat dan senang melihat dia dan dia tidak akan menderita kembali."}
, Summary = ""}
, 
[8155] = {Title = "Mazroka, penguasa musim dingin", 
Description = {"Didalam goa ini, mereka adalah \'Brazier\' dan \'Apple Tree\'. kamu keluar dari goa ini dengan ^0000ff100 Well Baked Cookies^000000 dari Brazier dan ^0000ff100 Apples^000000 dari Apple Tree."}
, Summary = "Keluar dari goa dengan Well Baked Cokkies and Apples."}
, 
[8156] = {Title = "Mazroka, penguasa musim dingin", 
Description = {"Seperti yang kamu dengar, Untuk membuat \'Golden Thread\' itu sangat susah dan memerlukan banyak waktu. Saya mulai sekarang.. coba saya periksa.. Biasakan kamu kembali lagi 1 jam kemudian?"}
, Summary = ""}
, 
[8157] = {Title = "Tes Mazroka", 
Description = {"Koshei akan bermusuhan denganmu karena kamu membantu Maria. Apakah kamu ingin mempunyai golden thread? Ok, Saya akan memberikan kepadamu! Tetapi, masih ada 1 tes lagi. Saya tidak mau kamu dikorbankan untuk desa kami and tolong hargai untuk itu."}
, Summary = ""}
, 
[8158] = {Title = "Pondok Tua", 
Description = {"Saya sedang mencari sebuah tukang kunci yang dapat membuat sebuah kunci! pembuat kunci Golden Key tinggal di dalam rumahnya di dalam hutan. ^ff0000kamu, mengalirlah, minumlah ini^000000 mantera melindungi kamu dari Babayaga.."}
, Summary = ""}
, 
[8159] = {Title = "Permohonan Babayaga", 
Description = {"Rasa takutku telah keluar semua. Temukan dia dan Keluarkan kembali mantera pembalik. manteranya adalah \'^ff0000Good feed is orange-flavored^000000\'. kamu seharusnya mengingat ini."}
, Summary = "Temukan sapi Babayaga"}
, 
[8160] = {Title = "Permohonan Babayaga", 
Description = {"Kamu mengeluarkan mantera ini dengan cepat dan ketakutannya dikelilingi oleh cahaya dan menghilang!!"}
, Summary = "Kembali ke Babayaga"}
, 
[8161] = {Title = "Permohonan Babayaga", 
Description = {"Dibelakang rumah saya, terdapat peti jenazah yang gaduh. Peti itu telah gaduh beberapa saat ini sehingga saya tidak dapat tidur di malam hari. Bebaskan mereka."}
, Summary = "Periksa peti."}
, 
[8162] = {Title = "Permohonan Babayaga", 
Description = {".........apabila kamu membuat kegaduhan sekali lagi, kamu akan melihat lebih dari yang kamu bayangkan..."}
, Summary = "Kembali ke Babayaga"}
, 
[8163] = {Title = "Permohonan Babayaga", 
Description = {"Tolong temukan sendok perakku. mereka bajak laut yang jahat mencurinya. Saya dapat merasakan mereka di sekitar bangkai kapal. Bawakan mereka untukku."}
, Summary = "Temukan sendok perak Babayaga"}
, 
[8164] = {Title = "Permohonan Babayaga", 
Description = {"Noda Kotor pada lembaran"}
, Summary = ""}
, 
[8165] = {Title = "Permohonan Babayaga", 
Description = {"Noda kotor pada lembaran, sesuatu terukir di tembok : Dia... hati-hati.. lagu putri duyung.. sedang tidur.. matanya.. melindungi kamu.. cermin"}
, Summary = ""}
, 
[8166] = {Title = "Permohonan Babayaga", 
Description = {"Noda kotor pada lembaran, sesuatu terukir di tembok : Dia... hati-hati.. lagu putri duyung.. sedang tidur.. matanya.. melindungi kamu.. cermin... Potongan dari kunci yang rusak beserta gagangnya"}
, Summary = ""}
, 
[8167] = {Title = "Permohonan Babayaga", 
Description = {"Noda kotor pada lembaran, sesuatu terukir di tembok : Dia... hati-hati.. lagu putri duyung.. sedang tidur.. matanya.. melindungi kamu.. cermin... Potongan dari kunci yang rusak beserta gagangnya, Potongan dari kunci yang rusak"}
, Summary = "Buat kunci dengan menyatukan semua potongan secara bersama-samas."}
, 
[8168] = {Title = "Permohonan Babayaga", 
Description = {"Cahaya yang dipantulkan membentuk tubuh wanita dan banunya keluar dari kotak itu dan terbuka!! Kamu menemukan sendok Babayaga"}
, Summary = "Kembali ke Babayaga"}
, 
[8169] = {Title = "Permohonan Babayaga", 
Description = {"Belikan saya sebuah buku sihir. Buku itu diterbitkan oleh momotaro di Amatsu. Pergilah kesana dan belikan untukku."}
, Summary = "Beli buku sihir dari Babayaga"}
, 
[8170] = {Title = "Permohonan Babayaga", 
Description = {"Apakah ini sudah benar? \' Sihir untuk menghancurkan waktu\', \'cerita tentang rumah hantu seputar dunia\', \'Aneh dan aneh akan dunia tumbuhan.\' kamu memerlukan beberapa buku, Tolong kontak kami."}
, Summary = "Kembali ke Babayaga."}
, 
[8171] = {Title = "Permohonan Babayaga", 
Description = {"Apakah kamu dapat melihat guci di sebelah pondok itu? Disana terdapat rumah hantu yang tinggal disana. Usir dia dari sana. Dia sudah banyak mengganggu saya."}
, Summary = "Usir arwah dari pondok."}
, 
[8172] = {Title = "Permohonan Babayaga", 
Description = {"Saya tidak akan membahayakan orang dan berlaku baik! Saya akan menjadi penjaga bagi rumah ini! Saya tidak akan lupa akan kebaikanmu untuk bermain dengan salah satu dari rumah hantu ini."}
, Summary = "Kembali ke Babayaga"}
, 
[8173] = {Title = "Permohonan Babayaga", 
Description = {"Pergilah ke nenek sapu di payon dan belikan saya sebuah sapu. Akan lebih baik untuk bersih-bersih tetapi saya tidak punya waktu untuk pergi kesana."}
, Summary = "Pergi ke Payon dan beli sebuah sapu."}
, 
[8174] = {Title = "Permohonan Babayaga", 
Description = {"Saya tidak punya sapu satupun. hantu-hantu telah mencuri semua sapu-sapu yang barus aja kubuat. Saya sangat tersanjung karena mereka berguna baik untuk hantu. Tetapi... Anakku pergi untuk mengambil sapu-sapu itu kembali, Tetapi dia gagal setiap kali karena hantu itu membohonginya."}
, Summary = " "}
, 
[8175] = {Title = "Permohonan Babayaga", 
Description = {"Ah. Saya kalah, Tetapi sangat menyenangkan. Saya akan memberikan kamu sapu sesuai janjiku. Jika Bisa, bermainlah bsersama saya lagi. ini sapunya."}
, Summary = "Kembali ke Babayaga"}
, 
[8176] = {Title = "Golden Key", 
Description = {"Kamu tepat waktu. Saya baru saja selesai membuat \'Golden Key\'! ini, bantu maria dengan kunci ini dan hati-hati dengan Koshei. Kehehehehehe."}
, Summary = "Bebaskan Maria"}
, 
[8177] = {Title = "Kejahatan abadi, Koshei", 
Description = {"Keeeek, Saya dapat menyembuhkan maria apabila saya merawatnya sekarang. Saya akan lari bersamanya dan kamu berurusan dengan Koshei!!"}
, Summary = "Kalahkan Koshei"}
, 
[8178] = {Title = "Air kehidupan dan kematian", 
Description = {"Untuk menyelamatkan Maria, kamu memerlukan Air kehidupan dan air kematian. Babayaga akan tahu apa yang harus dilakukan untuk membuat dia kembali hidup. Tolong dapatkan air kehidupan dan air kematian."}
, Summary = "Bawa Air Kehidupan dan Air Kematian"}
, 
[8179] = {Title = "Air kehidupan dan kematian", 
Description = {"\'Air kehidupan\'... Saya pernah mendengar ini sebelumnya. Saya butuh ^0000ff1 Holy Water^000000 dan ^0000ff2 The Leaf That Constitutes The World^000000 untuk membuat air kehidupan. dan untuk air kematian.. Saya membutuhkan ^0000ff1 Cursed Water^000000 ^0000ff10 Leaflet Of Hinal^000000."}
, Summary = "Bawakan bahannya ke Babayaga"}
, 
[8180] = {Title = "Air kehidupan dan kematian", 
Description = {"Bawa ini dan bantu maria. Pertama-tama, tuangkan air kematian kepada maria untuk menyembuhkan lukanya danmelepaskan kutukannya. lalu tuangkan air kehidupan untuk membuatnya kembali hidup."}
, Summary = "Bantu Maria."}
, 
[8181] = {Title = "Sight Blaster", 
Description = {"Skill ini sepertinya terdengar mudah tetapi susah untuk dipelajari. Knight sangat ahli dengan skills yang mendorong musuh kembali, jadi pergi dan temukan seseorang yang mampu menjelaskan skill teori dorong kebelakang untukmu di prontera. Cek arah jam 11 pada Mini-Map mu."}
, Summary = " "}
, 
[8182] = {Title = "Teori mendorong", 
Description = {"Baiklah, Saya akan menjelaskan skill mendorong sebaik yang saya bisa jelaskan. Konsentrasi dan latihan teorinya dengan dirimu sendiri, dan kamu akan dapat melakukan itu."}
, Summary = "Kembali ke Meow"}
, 
[8183] = {Title = "Sight Blaster", 
Description = {"Saya bukan orang yang dermawan, jadi saya mengharapkan bayaran atas semua instruksi dan dukungan saya! Pergi dan bawakan kepada saya^ff000010 Crystal Blues, 10 Green Lives, 10 Red Bloods, 10 Winds of Verdure^000000!"}
, Summary = "Bawakan bahan ke  Meow."}
, 
[8184] = {Title = "Elemental Converter", 
Description = {"Tolong berikan bahan-bahan yang dibutuhkan sehingga kita dapat membuat sebuah basic elemental converter. kamu memerlukan ^ff00007 Horns, 12 Rainbow Shells, 10 Snail\'s Shells, 4 Blank Scrolls, 10 Scorpion Tails^000000."}
, Summary = "Return to Mishuna with the materials."}
, 
[8185] = {Title = "Elemental Change", 
Description = {"Sekarang kamu mampu belajar skill  lainnya, ^ff0000Elemental Change^000000....Saya perlu untuk menyiapkan beberapa keperluan untuk pelajaran ini, jadi kita akan bertemu dan mendiskusikan ini lain kali saja, okay?"}
, Summary = " "}
, 
[8186] = {Title = "Fire Elemental Change", 
Description = {"Tolong bawakan ^ff000020 Red Bloods, 1 Payon Solution, 1 Morroc Solution^000000, lalu kamu dapat mempelajari ^ff0000Fire Elemental Change^000000."}
, Summary = "Kembali ke Mishuna bersama bahan tersebut."}
, 
[8187] = {Title = "Earth Elemental Change", 
Description = {"Tolong bawakan ^ff000020 Green Lives, 1 Payon Solution, 1 Morroc Solution^000000, lalu kamu dapat mempelajari ^ff0000Earth Elemental Change^000000."}
, Summary = "Kembali ke Mishuna bersama bahan tersebut."}
, 
[8188] = {Title = "Wind Elemental Change", 
Description = {"Tolong bawakan ^ff000020 Winds of Verdure, 1 Payon Solution, 1 Morroc Solution^000000, lalu kamu dapat mempelajari ^ff0000Wind Elemental Change^000000."}
, Summary = "Kembali ke Mishuna bersama bahan tersebut."}
, 
[8189] = {Title = "Water Elemental Change", 
Description = {"Tolong bawakan ^ff000020 Crystal Blues, 1 Payon Solution, 1 Morroc Solution^000000, lalu kamu dapat mempelajari ^ff0000Water Elemental Change^000000."}
, Summary = "Kembali ke Mishuna bersama bahan tersebut."}
, 
[8190] = {Title = "Charming Wink", 
Description = {"Kamu harus membawa kepada saya ^FF00001 Crystal Mirror^0000000! Alat ini sangat penting untuk pelajaran ini, jadi ambil dan bawakan kepada saya secepatnya!"}
, Summary = "Bawakan 1 Crystal Mirror untuk Canell."}
, 
[8191] = {Title = "Charming Wink", 
Description = {"Sekarang Anda telah membentuk sikap yang tepat pada kecantikan, Sekarang adalah saat yang tepat untuk mempelajari tehknik bujukan lebih lanjut. Pergi dan temukan adikku di gereja prontera. Dia akan berniat mengajarkan kamuShe\'ll be willing to teach you."}
, Summary = " "}
, 
[8192] = {Title = "Penasihat Egois", 
Description = {"Saya butuh minuman yang sesungguhnya, ^FF0000Alcohol^000000ic. Oh, dan saya butuh beberapa makanan ringan untuk mempertahankan seluruh tenaga pengajar saya! ^FF00001 Apple, 3 Bananas, 5 Well-Baked Cookies^000000 ditaruh di piring antik ^FF0000China^000000."}
, Summary = "Temui Aelle dengan minuman beralkohol dan hidangannya."}
, 
[8193] = {Title = "Penasihat Egois", 
Description = {"sekarang, Yang termudah,sikap paling halus dan paling menarik sepanjang waktu adalah ^FF0000wink^000000. Skill ini menyelamatkan saya di saat-saat krisis, dan menguasai ini akan meningkatkan daya tarikmu."}
, Summary = " "}
, 
[8194] = {Title = "Penasihat Pemabuk", 
Description = {"Per-Pergiii. Bicara kepada Canell, adikku..!..ZzzzzZzZZZzzzZZ.."}
, Summary = " "}
, 
[8195] = {Title = "Canell yang baik", 
Description = {"Sekarang, seorang dancer sejati harus dapat menemukan rahasia skill wink dengan diri sendiri. tetapi sejak saya adalah wanita yang baik, saya berkenan untuk menjelaskannya  kepadamu. Ho-ho~"}
, Summary = " "}
, 
[8196] = {Title = "Kerjasama tiga negara", 
Description = {"\"Para peneliti itu banyak mengeluh hari ini. Mereka sangat stres dan saya pikir seseorang harus benar-benar mendengarkan masalah mereka.. Terutama mereka yang menangani file dokumen berdebat satu sama lain berkali-kali. Kamu mungkin ingin memulai dengan berbicara kepada mereka.\""}
, Summary = " "}
, 
[8197] = {Title = "Mengantar Dokumen", 
Description = {"\"Oke, silakan kirimkan file ke Hue dan Hansenne. Hue yang bertanggung jawab atas dokumen Schwartzvalt dan Hansenne yang bertanggung jawab atas Arunafeltz \'. Kamu harus pergi melihat Hue di kantor Schwartzvalt\'s, atau, ia akan mengeluh tentang hal itu.\""}
, Summary = "Menyampaikan dokumen untuk Hue dan Hansenne dan kembali ke Ryosen "}
, 
[8198] = {Title = "Lapor pada Pusat Penelitian Gabungan", 
Description = {"\"Yah, itu sudah terlanjur. Saya harus pergi ke pertemuan itu apakah aku suka atau tidak.. Bisa kamu kirimkan ini ke Pusat Penelitian Gabungan? Sementara itu, aku harus mempersiapkan diri untuk pertemuan tersebut.\""}
, Summary = "Menyampaikan dokumen ke Pusat Penelitian Gabungan"}
, 
[8199] = {Title = "Permohonan Pusat Penelitian Gabungan", 
Description = {"\"Silakan, kamu harus berpartisipasi dalam rapat dan memediasi mereka jika ada yang tidak beres! Pertama, kamu harus pergi memeriksa 3 orang itu apakah mereka mempersiapkan diri untuk pertemuan tersebut. Kuharap mereka tidak mempersiapkan senjata.\""}
, Summary = " "}
, 
[8200] = {Title = "Permohonan Dukumen Ryosen", 
Description = {"\"Saya telah meminta sesuatu dari kantor Arunafeltz tetapi tidak dikirimkan. Bisakah kamu mendapatkannya dari Hansenne? Saya memerlukannya untuk rapat, tetapi ia tidak mengirimkannya kepada saya. Dia pasti lupa lagi tentang itu!\""}
, Summary = " "}
, 
[8201] = {Title = "Dokumen yang Hilang", 
Description = {"\"Aku kehilangan itu. Mungkin saya telah menjatuhkannya sungai atau sesuatu seperti itu ketika saya bermain-berburu harta karun di jembatan! Tapi, kucing yang di Selatan-Barat dapat mengajar kita memancing. Mungkin kita bisa menemukan dokumen dengan memancing di sungai!\""}
, Summary = "Kembali ke Hansenne dengan dokumen yang kamu temukan"}
, 
[8202] = {Title = "Memperbaiki Dokumen", 
Description = {"\"Orang yang berasal dari Schwartzwalt memiliki bakat dalam memperbaiki hal-hal seperti ini ... Mengapa kamu tidak meminta Hue untuk memperbaikinya? Dia berteriak begitu keras dan mungkin merusak jendela.\""}
, Summary = " "}
, 
[8203] = {Title = "Memperbaiki Dokumen", 
Description = {"\"Ini benar-benar basah kuyup .. Pertama saya harus kering ini menghilangkan kerutan ini. Lalu, saya harus mengembalikan teksnya. Aku butuh beberapa bahan. Kau harus membantu saya dalam hal ini. Aku perlu ^0000ff1 Folding Fan of Cat Ghost, 1 Old Frying Pan, 1 Flame Stone, 1 Squid Ink^000000.\""}
, Summary = "Bawakan 1 Folding Fan of Cat Ghost, 1 Old Frying Pan, 1 Flame Stone, 1 Squid Ink"}
, 
[8204] = {Title = "Ryosen", 
Description = {"\"Ikatannya terlalu longgar, jadi aku atur kembali dan mengencangkan ikatannya. Tolong, antarkan file ini sebelum terlambat.\""}
, Summary = " "}
, 
[8205] = {Title = "Lapor pada Pusat Penelitian Gabungan", 
Description = {"\"Bisa kamu minta para ofisial untuk menunggu saya sebentar? Saya harus mencari dokumen lain untuk rapat.\""}
, Summary = " "}
, 
[8206] = {Title = "Rapat Para Peneliti", 
Description = {"Ikut serta dalam rapat"}
, Summary = " "}
, 
[8207] = {Title = "Hansenne tidak salah.", 
Description = {"\"Aku hanya ingin mereka menjadi dekat satu sama lain, menjadi lebih ramah .. Namun, masalah muncul setiap saat. Dapatkah kamu memikirkan ide bagaimana untuk membuat mereka lebih dekat?\""}
, Summary = " "}
, 
[8208] = {Title = "Permintaan Hansenne", 
Description = {"\"Dia akan baik-baik saja. Dia akan berpikir bahwa itu bukan masalah besar. Tapi masalahnya adalah... hubungan antara Ryosen dan Hue tidak baik sama sekali. Kenapa kamu tidak membantu mereka agar dapat berteman?\""}
, Summary = " "}
, 
[8209] = {Title = "Laporan Hue", 
Description = {"\"Ini adalah laporan Rune-Midgard yang aku bawa saya ketika semuanya berjalan berantakan di ruang rapat .. Bisa tolong berikan ini ke Ryosen?\""}
, Summary = " "}
, 
[8210] = {Title = "Laporan untuk Pusat Penelitian Gabungan", 
Description = {"\"Ok. I should set up another meeting asap. Could you go see the official instead of me and set up a meeting?\""}
, Summary = " "}
, 
[8211] = {Title = "Pengajar Shurank", 
Description = {"Kamu belum mempelajari Skill Bash. Kamu belum siap untuk...Oh baiklah, Kamu masih mempunyai hari yang cerah bersamamu. Namun, kamu mesti mempelajari Bash terlebih dahulu. ^FF0000Bash^000000 merupakan dasar dari Swordman. Jangan Lupa!!"}
, Summary = "Kembali kepada Shurank setelah mempelajari Skill [Bash]."}
, 
[8212] = {Title = "Pengajar Shurank", 
Description = {"Hmm, akhirnya kamu mempelajari Bash, Tapi jangan puas dulu. Tetap berlatih! Saya akan selalu ada disini."}
, Summary = "Kembali ke Shurank setelah mempelajari lebih tinggi lagi skill [Bash]."}
, 
[8213] = {Title = "Pengajar Shurank", 
Description = {"Ho.. Bagaimana perkembangan skill Bash yang kamu miliki? bagaimanapun, masih belum cukup. Teruslah berlatih! Saya akan selalu ada disini."}
, Summary = "Kembali ke Shurank setelah menguasai sepenuhnya skill [Bash]."}
, 
[8214] = {Title = "Pengajar Shurank", 
Description = {"Ho.. Kamu telah menguasai sepenuhnya skill [Bash]! mengesankan. Ingat, janganlah sombong. Tetaplah berlatih! kamu baru menyelesaikan dasarnya dan perjalananmu masih panjang."}
, Summary = "Mendengar nasehat Pengajar Shurank"}
, 
[8215] = {Title = "Pengajar Shurank", 
Description = {"Mari hentikan pembicaraan tentang Improved HP Recovery, dan bagaimana jika saya memberitahumu? Oh ya, Provoke! Mari mulai mempelajari Provoke. Sebelumnya, Saya membutuhkan persiapan untuk pelajarannya. Bicara lagi denganku nanti."}
, Summary = "Mendengar nasehat Pengajar Shurank"}
, 
[8216] = {Title = "Permintaan Shurank", 
Description = {"Temui Knight  ^FF0000 DeQuey^000000 yang berada di ^FF0000Geffen^000000 untuk menyampaikan pesan saya. ^0000FF Bagaimana penyelidikanmu tentang Assassin? Apa kamu mengetahui siapa dia? Jika telah mengetahui, apa yang harus kita lakukan sekarang?^000000 ..ini adalah pesanku."}
, Summary = "Temui DeQuey di Geffen dan sampaikan pesan Shurank."}
, 
[8217] = {Title = "Pesan DeQuey", 
Description = {"Pesan ini dari Shurank? Saya mengerti, sampaikan padanya, Belum, namun tidak akan lama lagi, Saya akan membutuhkan bantuanmu disaat waktunya telah tiba. Selesai!"}
, Summary = "Antarkan pesan DeQuey kepada Shurank di Izlude."}
, 
[8218] = {Title = "Pengajar Shurank", 
Description = {"Hmm..Kamu belum mempelajari Provoke. Dasarnya sudah bagus, tapi kamu harus bisa menggunakan skill untuk dilatih untuk menjadi seorang swordman! mulai sekarang, fokus untuk berlatih Provoke."}
, Summary = "Mempelajari skill [Provoke] dan kembali ke Shurank"}
, 
[8219] = {Title = "Pengajar Shurank", 
Description = {"Hmm. Jadi kamu telah mempelajari Provoke...tapi masih belum cukup. Berlatihlah skill Provoke lebih baik lagi."}
, Summary = "Melatih sekill [Provoke] lebih tinggi dan kembali ke Shurank"}
, 
[8220] = {Title = "Pengajar Shurank", 
Description = {"Hmm...Untuk pelajaran berikutnya! Saya akan mengajarimu ^FF0000 Endure^00000. Pergilah keluar dan cari air segar, Lalu kembali lagi kepadaku."}
, Summary = "Mendengar instruksi pengajar Shurank"}
, 
[8221] = {Title = "Pengajar Shurank", 
Description = {"Skill Endure merupakan skill yang mengabaikan setiap serangan lawan. Dengan kata lain, skill ini seperti membuatmu \'Tak terhentikan!\' meskipun mendapat banyak serangan dari lawan. Mulai sekarang, fokuslah berlatih Endure!!"}
, Summary = "Belajar skill [Endure] dan kembali ke Shurank"}
, 
[8222] = {Title = "Permintaan Shurank", 
Description = {"Pelajaran bertahan kali ini. Ada yang harus kamu kerjakan. Hampir sama dengan apa yang telah kamu kerjakan sebelumnya. Masih ingat DeQuey waktu itu? Dia membutuhkan bantuanmu. Bergegaslah. Kembalilah padaku setelah membantunya dengan pekerjaannya..."}
, Summary = "Temui DeQuey."}
, 
[8223] = {Title = "Permintaan DeQuey", 
Description = {"Pergi ke ^FF0000 Morocc. dan temui Mutro, Gale, Hans, dan Bangkley^000000. kemudian cari tahu siapa assassin tersebut! Itu tugas untukmu. Bicara dengan mereka dan kembali kepadaku."}
, Summary = "Mencari tahu tentang Assassin dan kembali ke DeQuey."}
, 
[8224] = {Title = "Bukti Kejahatan", 
Description = {"Jakledaisajeungmyutgyuneum, basasodahechiwhoukra, euibaenomsalneumga, yongneunleeguearmlaguhgaeduh... Ini adalah kalimat yang aneh. Apa artinya? Kamu tahu. Saya tidak mendapatkan petunjuk. Tapi saya yakin ini adalah petunjuk yang penting untuk mencari penjahatnya."}
, Summary = " "}
, 
[8225] = {Title = "Kesimpulan DeQuey", 
Description = {"Bangkley Orangnya!!! Dialah Assassin itu!! Pergilah ke morroc dan mengawasinya! Laporkan padaku jika sesuatu terjadi!"}
, Summary = "Tetap waspada akan pergerakan Bangkley di Morocc."}
, 
[8226] = {Title = "Kematian Bangkley", 
Description = {"Dia sudah mati. Wajahnya terlihat marah dan suram seakan-akan tuduhan terhadapnya salah. Dilihat dari darahnya yang keluar, tampaknya dia belum lama mati. ada luka tusukan yang dalam di dadanya dan tangan kanannya memegang pisau yang dilumuri darah.-"}
, Summary = "Melapor kepada DeQuey tentang kematian Bangkley."}
, 
[8227] = {Title = "Kembali kepada Shurank", 
Description = {"Ada suatu yang aneh dibalik peristiwa ini, Tapi kita tidak bisa berbuat apapun saat ini. Kamu masih dalam pelatihan kan? Kembalilah ke Shurank. Kamu melakukan pekerjaan dengan baik. Terima kasih."}
, Summary = "Kembali ke Shurank"}
, 
[8228] = {Title = "Pengajar Shurank", 
Description = {"Saya akan menjelaskan tentang Magnum Break untuk yang terakhir. Saya membutuhkan persiapan, Kembalilah lagi nanti."}
, Summary = "Mendengar instruksi pengajar Shurank"}
, 
[8229] = {Title = "Pengajar Garning", 
Description = {"Kamu belum siap untuk menjadi Merchant. Dasar dari Merchant adalah.. Skill ^FF0000 Enlarge Weight Limit^000000! Naikkan level Skill [Enlarge Weight Limit] sampai Lv. 4. dan kami akan memulai pelajaranmu."}
, Summary = "Pelajari Skill [Enlarge Weight Limit] sampai Lv. 4 dan kembali ke Garning."}
, 
[8230] = {Title = "Pengajar Garning", 
Description = {"Lain kali, saya akan mengajarkan bagaimana cara mengidentifikasi Item dan skill dasar, Mammonite. Sampai saat itu, Beristirahatlah! Kembali padaku jika kamu sudah siap."}
, Summary = "Mendengar penjelasan Garning."}
, 
[8231] = {Title = "Pengajar Garning", 
Description = {"Lain kali, saya akan mengajarkan skill ^FF0000 Discout^000000! Bersiaplah!"}
, Summary = "Mendengar penjelasan Garning"}
, 
[8232] = {Title = "Pengajar Garning", 
Description = {"Kembali setelah mempelajari skill Discount Lv.4! Saya juga ingin agar kamu mempelajari sepenuhnya, Tapi kita punya banyak lainnya yang belum dipelajari... Jadi.. Lv. 4!!! sudah cukup asalkan telah Lv.4, dan tidak kurang!"}
, Summary = "Pelajari skill [Discount] Lv. 4 dan kembali ke Garning."}
, 
[8233] = {Title = "Pengajar Garning", 
Description = {"Kamu sudah belajar jauh, Saya akan memberimu sedikit ujian. Jangan kawatir... hanya tugas Sederhana. Kembali lagi jika kamu telah siap..HuHuHu."}
, Summary = "Mendengar penjelasan Garning"}
, 
[8234] = {Title = "Meneliti pasar Prontera", 
Description = {"Pergilah ke kota Prontera dan beli 10 Red potion! Saya tidak ingin kamu membeli dimanapun, kamu harus temukan harga termurah dan membelinya. Tentu saja, kamu harus membelinya dari NPC, bukan pemain."}
, Summary = "Beli 10 Red Potion dengan harga murah dan kembali kepada Garning."}
, 
[8235] = {Title = "Pengajar Garning", 
Description = {"Selanjutnya, Say akan mengajarkan skill ^FF0000 Overcharge^000000. hahaha."}
, Summary = "Mendengar penjelasan Garning"}
, 
[8236] = {Title = "Pengajar Garning", 
Description = {"Overcharge merupakan skill yang dapat menjual item dengan harga lebih tinggi dari harga NPC. Skill ini amat penting untuk Merchant. Jadi kamu mesti mempelajari skill ini sampai level tertentu. Hmm..bagaimana kalau lv. 4??"}
, Summary = "Pelajari skill [Overchage] sampai Lv.4 dan kembali Garning."}
, 
[8237] = {Title = "Pengajar Garning", 
Description = {"Lain waktu saya akan mengajarkanmu skill Push Cart. Ini juga skill yang mencirikan seorang Merchant. Jadi bersiaplah!..sebelumnya, pikirkan juga, skill ini bukan merupakan skill terpenting..."}
, Summary = "Mendengar penjelasan Garning"}
, 
[8238] = {Title = "Pengajar Garning", 
Description = {"Skill ^FF0000 Push Cart^000000 skill akan muncul ketika kamu telah mempelajari skill [Enlarge Weight Limit] Lv.5. Skill ini tidak berhubungan dengan overchage dan discount. kembalilah lagi setelah kamu telah mempelajari sampai Lv. 4!"}
, Summary = "Pelajari skill [Push Cart] hingga Lv.4 dan kembali ke Garning."}
, 
[8239] = {Title = "Pengajar Garning", 
Description = {"Dan yang terakhir kali, Saya akan mengajarkan tentang skill Vending. Kembalilah jika kamu telah siap."}
, Summary = "Mendengar penjelasan Garning."}
, 
[8240] = {Title = "Pengajar Garning", 
Description = {"Dan terakhir dari saya. Pelajari skill [Vending] samapi Lv. 4 dan kembali lagi. Saya akan berikan hadiah kecil untukmu!. Kembalilah setelah kamu mempelajari skillnya."}
, Summary = "Pelajari skill [Vending] sampai Lv.4 dan kembali ke Garning."}
, 
[8241] = {Title = "Pengembalian Permata Merah", 
Description = {"Temukan kembali permata merah dari dalam gundukan tanah! "}
, Summary = "Bawakan kembali permata kepada Scholar midgard yang ada di Dunia lain."}
, 
[8242] = {Title = "Pengembalian Permata Biru", 
Description = {"Temukan kembali permata biru dari dalam gundukan tanah! "}
, Summary = "Bawakan kembali permata kepada Scholar midgard yang ada di Dunia lain."}
, 
[8243] = {Title = "Bahasa Dunia lain", 
Description = {"Disekitar dunia lain, terdapat bangsa yang mempunyai bahasa aneh yang tidak pernah ditemukan di Midgard. Koalisi tiga negara dalam penyelidikan bekerja sama untuk meneliti akan bahasa ini....Tanpa disadari ^0000ffAhli bahasa dari Arunafeltz^000000 sedang mengerjakan transkipnya."}
, Summary = ""}
, 
[8244] = {Title = "Peri dan Raksasa kayu", 
Description = {"Pergilah disekitar Perkemahan Ekspedisi, dan temui seorang Peri dan Raksasa dan beritahu saya tepatnya! Maksudku sejelasnya! apa yang mereka katakan."}
, Summary = "Temui Peri dan Raksasa dan pergi ke ahli bahasa Arunafeltz"}
, 
[8245] = {Title = "Meneliti Contoh Bahasa", 
Description = {"Saya mendengar ^0000ffScholar dari Midgard^000000 tahu cara untuk meneliti contoh bahasa, maukah kamu menemuinya dan cari tau artinya? Sangat berat untuk melanjutkan penelitian tanpa contoh bahasa yang telah mereka buat."}
, Summary = ""}
, 
[8246] = {Title = "Meneliti Contoh Bahasa", 
Description = {"Jadi, kamu telah menemui 2 bangsa tersebut. Assasin kita secara diam-diam telah menguburkan permata didekat desa mereka. Berhati-hatilah saat hendak mengambilnya lagi. Para Assassin itu telah memasang jebakan disekitar permata yang ditanam."}
, Summary = "Temukan kembali permata dan kembali ke Scholar dari Midgard."}
, 
[8247] = {Title = "Memeriksa Hasil Penelitian", 
Description = {"Saya akan menyimpan suara secara acak di permata ini dan mengantarkannya ke ahli bahasa dari Arunafeltz. Jika kamu punya waktu, temuilah ahli bahasa dan periksa hasilnya."}
, Summary = ""}
, 
[8248] = {Title = "Memeriksa Hasil Penelitian", 
Description = {"Proses transkip berjalan baik. Permasalahannya adalah, berapa lama kita menyimpan informasi ini?... Mukan kamu menemui ahli mesin dari Schwaltzvalt dan tanyakan apakah dia mempunyai cara?"}
, Summary = ""}
, 
[8249] = {Title = "Bagaimana menyimpan Informasi", 
Description = {"Saya mendengar melalui kekuatan mantra sihir Rune Midgard, kita bisa menyimpan informasi kedalam sebuah permata dengan menggunakan kekuatan magic...Saya ingin mendengar penjelasan dari Scholar Midgard. Maukah kamu menanyakannya?"}
, Summary = ""}
, 
[8250] = {Title = "Mineral dari Dunia Lain", 
Description = {"Saya dengar bahwa kamu bisa menemukan ^0000ffMineral Misterius yang tidak bisa ditemukan di Midgard^000000 disekitar wilayah perkemahan Ekspedisi, di area yang dingin. Saya mungkin bisa mendapatkan sesuatu jika saya mempunyai mineral itu!. Maukah kamu mencarikan mineral itu untukku?"}
, Summary = "Dapatkan Mineral Misterius dan kembali ke Scholar Midgard"}
, 
[8251] = {Title = "Konversi Kekuatan Magic", 
Description = {"Tunggulah sebentar. Saya akan membentuk mineral menjadi sebuah permata, dan memasukkan informasi magic kedalamnya. Kamu terlihat lelah..."}
, Summary = ""}
, 
[8252] = {Title = "Membentuk Permata", 
Description = {"Ini adalah permintaan terakhir dari saya. Antarkan Permata ini kepada ahli mesin dari Schwaltzvalt."}
, Summary = ""}
, 
[8253] = {Title = "Penerjemah Bahasa Dunia Lain", 
Description = {"Saya akan membuat mesih yang bisa membaca deskrips kekuatan magic didalam permata ini. Saya sudah menyiapkan semuanya, mungkin akan memakan waktu selama satu jam."}
, Summary = "Kembali kepada ahli mesin dari Schwaltzvalt setelah satu jam"}
, 
[8254] = {Title = "Dengan Hati dan Tubuh yang ringan", 
Description = {"Sebelum Anda mengubah job Anda, Anda harus memeriksa apakah skill Anda sudah maksimal. Apakah mungkin karena item anda? untuk memeriksanya, aku akan mengevaluasi kemampuan Anda~"}
, Summary = "buat beratmu \'0 \' kemudian pergi ke Resque di turtle island"}
, 
[8255] = {Title = "Ujian Kekuatan", 
Description = {"Jika Anda lulus dalam ujianan kekuatan, Anda bisa mendapatkan kualifikasi untuk mengambil tes praktek~ \"Aku akan menceritakan detail setelah Anda mendapatkan kualifikasi untuk mengambil tes praktek~ Jika Anda merasa siap mengikuti ujian, bicara dengan saya lagi."}
, Summary = "Berbicara dengan Resque di Turtle Island"}
, 
[8256] = {Title = "Tes Kekuatan", 
Description = {"Dengan item yang diberikan, ^0000ffpergi ke arah jam 11, disana tempat untuk ujian praktek^000000. Anda harus berhati-hati karena Anda tidak memiliki peralatan~"}
, Summary = "Pergi ke tempat untuk mengambil tes praktek diarak jam 11"}
, 
[8257] = {Title = "Makanan untuk Teardrop", 
Description = {"Metode dasar untuk hidup adalah tubuh yang kuat, dan juga kekuatan untuk mendapatkan makanan. Di Turtle island ini, cari satu ^0000ffdragontail^000000, dan satu ^0000ffdragon fly wing^000000now."}
, Summary = "Dapatkan satu dragontail dan dragon fly wing kemudian temui Teardrop di Turtle Island"}
, 
[8258] = {Title = "Makanan untuk Teardrop", 
Description = {"Bagus, sekarang Anda telah memenuhi syarat untuk mengambil tes praktek. OK, dapatkah Anda menyerahkan dragon fly wing pada saya? Apakah Anda tahu bahwa sebuah roti lebih baik ribuan kicauan burung?"}
, Summary = "Berbicara dengan Teardrop di Turtle Island"}
, 
[8259] = {Title = "Menuju tempat tes praktek", 
Description = {"Tes ini terdiri dari 3 bagian. Ketika Anda memasuki ruang pemeriksaan, akan ada anggota yang mempersiapkan. Lalu Anda masuk ruangan yang disiapkan oleh anggota, dan menunggu. Tes akan berlangsung satu per satu. Sehingga Anda perlu menunggu, semoga berhasil, samapi bertemu lagi saat kamu menjadi Ranger."}
, Summary = "Anda memasukkan ruang pemeriksaan melalui Teardrop di Turtle Island, Anda mengambil 3 tes"}
, 
[8260] = {Title = "Misi! Mengantar Dokumen", 
Description = {"Anda harus memberikan dokumen ini pada Coution. Ia tidak mengambil dokumen ini ketika saya mengantarkannya"}
, Summary = "Mengambil uji praktek ke 2, menyerahkan dokumen ini pada Coution"}
, 
[8261] = {Title = "Ketika Anda bermain seruling, serigala muncul!", 
Description = {"Ujian ke 3 untuk menguji skill menggunakan serigala yang akan dipelajari ketika Anda menjadi Ranger yeah-yo! Ambil pipa ini untuk memanggil serigala, dan berbicara kepada saya setelah Anda memanggil wolf!"}
, Summary = "Setelah Anda memanggil serigala, berbicara dengan Prize yang menawasi ujian ke 3"}
, 
[8262] = {Title = "Ranger master Neveragain", 
Description = {"Selamat! Anda lulus semua ujian praktek! Anda memiliki cukup pengalaman sebelum Anda berubah job, ^0000fflepaskan Falcon^000000, dan ^0000ffSkill pinmu sudah habis?^000000 coba periksa lagi."}
, Summary = "Lepaskan Flacon, periksa skill poin, dan bicara pada Neveragain lagi"}
, 
[8265] = {Title = "One time a one hour!", 
Description = {"bermain game berlebihan tidak baik!"}
, Summary = "Anda tidak bisa bermain dengan Yohean dalam satu jam."}
, 
[8266] = {Title = "Berburu poison spore!", 
Description = {"Kalahkan 10 poison spore, dan ketika Anda menyelesaikan, temui Sponiac di geffen. Lokasi poison spore : geffen dungeon 1, field timur laut dari geffen, Lorong Prontera 3, Sunken Ship 1, dll."}
, Summary = "Kalahkan 10 poison spore!"}
, 
[8267] = {Title = "Berburu smokie!", 
Description = {"Kalahkan 10 smokie, dan ketika Anda menyelesaikan, temui Sponiac di geffen. Lokasi smokie : field arah timur laut geffen, field arah barat laut geffen, field arah timur Ayotaya, dll."}
, Summary = "Kalahkan 10 smokie!"}
, 
[8268] = {Title = "Berburu elder wilow!", 
Description = {"Kalahkan 10 elder wilow, dan ketika Anda menyelesaikan, temui Sponiac di geffen. Lokasi elder wilow : field di utara timur laut geffen, field di timur timur payon, field diarah selatan selatan barat barat prontera, etc."}
, Summary = "Kalahkan 10 elder wilow!"}
, 
[8269] = {Title = "Berburu coco!", 
Description = {"Kalahkan 10 coco, dan ketika Anda menyelesaikan, temui Sponiac di geffen. Lokasi coco : field timur timur payon, field in diarah selatan selatan barat barat prontera, field arah timur Ayotaya etc."}
, Summary = "Kalahkan 10 coco!"}
, 
[8270] = {Title = "Berburu thara frog!", 
Description = {"Kalahkan 10 thara frog, dan ketika Anda menyelesaikan, temui Sponiac di geffen. Lokasi thara frog : Gua timur komodo, field dari turtle island, dll."}
, Summary = "Kalahkan 10 thara frog!"}
, 
[8271] = {Title = "Mengantarkan Toxic sprays!", 
Description = {"Kamu menerima item dari Daisin di morroc pyramid, dan antarkan pada zoologist diarah timur sekali dan ke utara sekali dari payon."}
, Summary = "Mengantarkan toxic sprays!"}
, 
[8272] = {Title = "Mengantarkan honey!", 
Description = {"Kamu menerima item dari Daisin di morroc pyramid, antarkan pada entomologist diarah barat dari Saint Capitolina abbey dan arah timur sekali lalu ke utara dan ke timur lagi dari prontera."}
, Summary = "Mengantarkan honey!"}
, 
[8273] = {Title = "Mengantarkan  selimut!", 
Description = {"Kamu menerima item dari Daisin di morroc pyramid, antarkan pada biologist di arah selatan dari Lutie."}
, Summary = "Mengantarkan selimut!"}
, 
[8274] = {Title = "Collect bones!", 
Description = {"Antarkan \'10 bone\' pada Dasa di payon. Bones drop dari monster : skeleton / lokasi monster : payon dungeon 1, dll"}
, Summary = "Kumpulkan \'10 bones\', dan antarkan pada Dasa di payon"}
, 
[8275] = {Title = "Collect feet!", 
Description = {"Kumpulkan \'10 feet\' dan \'5 animal skins\', lalu antarkan pada Dasa di payon. Beruang dan animal skin drop dari monster : Big foot / lokasi monster : ke utara dua kali dari geffen, timur sekali lalu selatan dari payon, dll"}
, Summary = "Kumpulkan \'10 feet\' dan \'5 animal skins\', lalu antarkan pada Dasa di payon"}
, 
[8276] = {Title = "Collect scell!", 
Description = {"Kumpulkan \'20 scell\' and \'20 Garlet\', and deliver to Dasa in payon. scell, garlet drop monster : Pierre, Andre, Deniro etc / the location of monster : the 1st floor, 2nd floor in an ant hell dungeon etc"}
, Summary = "Collect \'20 scell\' and \'20 Garlet\', and deliver to Dasa in payon"}
, 
[8277] = {Title = "Collect tails!", 
Description = {"Kumpulkan \'10 monkey tail\', \'10 acorn\' and \'10 leaf of raccoon\' lalu antarkan pada Dasa di payon. monkey tail drop dari monster : yoyo, acorn drop dari monster : coco, leaf of raccoon drop dari monster : smokie / lokasi monster : timur dari Ayotaya, dll"}
, Summary = "Kumpulkan \'10 monkey tail\', \'10 acorn\' and \'10 leaf of raccoon\' lalu antarkan pada Dasa di payon"}
, 
[8278] = {Title = "Collect cookies!", 
Description = {"Kumpulkan 5 well-baked cookies, 1 piece of cake lalu antarkan pada Dasa di payon. well-baked cookie drop dari monster : cookie, piece of cake drop dari monster : Mystcase / lokasi monster : Toy Factory 1, 2, dll"}
, Summary = "Kumpulkan 5 well-baked cookies, 1 piece of cake lalu antarkan pada Dasa di payon"}
, 
[8279] = {Title = "Collect mustache!", 
Description = {"Kumpulkan 5 mustache of a mole, 3 nail of a mole lalu antarkan pada Dasa di payon. mustache of a mole, nail of a mole drop dari monster : Martin / lokasi monster : Jalan Buntu 1, 2, dll"}
, Summary = "Kumpulkan 5 mustache of a mole, 3 nail of a mole lalu antarkan pada Dasa di payon"}
, 
[9000] = {Title = "Quest Rubah Job Knight", 
Description = {"Kapten Chivalry Captain \'Herman\' mengatakan kamu perlu mendapatkan ijin oleh knight lain untuk menjadi Knight."}
, Summary = "Bicara kepada anggota lain dari Chivalry."}
, 
[9001] = {Title = "Kesetiaan Knight", 
Description = {"Ujian oertama dari Sir Andrew!"}
, Summary = "5 Elder Pixie Moustache, 5 Wing of Red Bat, 5 Orcish Voucher, 5 Moth Dust, 5 Reptile Tongue dan 5 Mane harus dikumpulkan dan dilaporkan kembali kembali kepada Andrew."}
, 
[9002] = {Title = "Kesetiaan Knight", 
Description = {"Ujian pertama dilakukan oleh Sir Andrew!"}
, Summary = "5 of each Bug Leg, Heart of Mermaid, Maneater Blossom, Clam Flesh, Old Frying Pan and Snail\'s Shell harus dikumpulkan dan dilaporkan kembali kembali kepada Andrew."}
, 
[9003] = {Title = "Kehormatan Knight", 
Description = {"Sir Andrew mengatakan kepada kamu untuk menemui Sir Siracuse untuk melanjutkan ujian ."}
, Summary = "Berbicara dengan \'Sir Siracuse\'"}
, 
[9004] = {Title = "Kehormatan Knight", 
Description = {"\'James Siracuse\' mengatakan kepada kamu untuk menemui Sir Windsor untuk melanjutkan ujian."}
, Summary = "Berbicara dengan \'Sir Windsor\'"}
, 
[9005] = {Title = "Ketahanan Knight", 
Description = {"\'Sir Windsor\' hanya memerintahkan kamu untuk mengikutinya...."}
, Summary = "Berbicara dengan \'Sir Windsor\'"}
, 
[9006] = {Title = "Ketahanan Knight", 
Description = {"\'Sir Windsor\' tidak banyak bicara. Dia menyuruh kamu untuk membunuh semua monster di dalam ruangan ujian."}
, Summary = "Bunuh semua monster dalam 3 menit"}
, 
[9007] = {Title = "Kehormatan Knight", 
Description = {"\'Sir Windsor\' mengatakan kepada kamu untuk mengunjungi \'Amy Beatrice\' untuk ujian selanjutnya."}
, Summary = "Berbicara dengan \'Amy Beatrice\'"}
, 
[9008] = {Title = "Etika Knight", 
Description = {"Seorang knight wanita yang bangga dari Prontera Chivalry, \'Amy\' menyuruh kamu menjawab pertanyaannya sebagai seorang Knight."}
, Summary = "Berbicara dengan \'Amy Beatrice\'"}
, 
[9009] = {Title = "Hidup sebagai Knight", 
Description = {"\'Amy Beatrice\' mengatakan kepada kamu untuk menemui \'Sir Edmond\' untuk ujian selanjutnya."}
