, 
[11145] = {Title = "Aku ingin pergi ke", 
Description = {"Ada tempat yang ditinggal boneka beruang antara einbroch & Lighthalzen. Jika Anda pergi ke sana, bisa Anda menemukan sesuatu??"}
, Summary = "Setelah kami berburu 33 beruang, kita bisa bergabung dengan Karien di Lighthalzen."}
, 
[11146] = {Title = "Menuju terowongan es...", 
Description = {"Saya pernah mendengar bahwa ada boneka menumpuk di dalam kamar hotel, dan menghasilkan pakaian bulu dari beruang. Dan mereka menuju ke terowongan es."}
, Summary = "Mari kita kembali ke terowongan es."}
, 
[11147] = {Title = "Embun Lared", 
