, Summary = "Dia kehilangan kesadaran ketika mendapatkan info tentang ^000077Embun Lared^000000."}
, 
[11148] = {Title = "Menuju Comodo dengan busur", 
Description = {"Tidak ada perahu untuk pulang pergi, dan ada feri ketika Anda pergi ke bagian selatan Veins..."}
, Summary = "Minstrel Song pasti pergi ke Comodo. Mari kita kembali ke bagian selatan veins."}
, 
[11149] = {Title = "Menuangkan air. Tuang... Tuang...", 
Description = {"Tuang air dan air ... tapi saya pikir itu cukup menantang!"}
, Summary = "Sementara kita pergi ke sana, ada yang bocor ... tapi kami bisa tiba di sana."}
, 
[11150] = {Title = "Mencari Minstrel Song", 
Description = {"Haruskah saya bertanya pada orang-orang sekitar desa?"}
, Summary = "Mari kita dapatkan info dari penduduk desa."}
, 
[11151] = {Title = "Mencari Minstrel Song", 
Description = {"Nyonya pemilik tanah sangat baik dalam mebaca karakter orang. Itu salah satu skill untuk berdagang yang baik!?"}
, Summary = "Mari kita bertanya kepada nyonya itu."}
, 
[11152] = {Title = "Ketempat yang sunyi!...", 
Description = {"Saya baru saja selesai barbekyu, itu sebabnya dia pasti mengenali saya!"}
, Summary = "Minstrel Song pergi lebih dahulu ke bagian selatan timur morroc! Mari kita cari gedung akan terlihat misterius."}
, 
[11153] = {Title = "Puncak menara yang hilang", 
Description = {"Bukti yang diperoleh di depan Thanatos tower dan lirik yang diperoleh di Hugel, dan puisi dai koran! Semuanya sama!"}
, Summary = "Mereka baru menyadari koran yang ada di dalam pasir, dan Karian tiba-tiba mengatakan bahwa dia ingin melihat puncak jam di Aldebaran."}
, 
[11154] = {Title = "Aku akan mengingat kenangan dengan kamu....", 
Description = {"Ini tempat yang di sukai teman saya. Setiap kali kami lelah, kita melihat jam dan mendapatkan ketenangan. Saya tidak bisa melupakan kenangan ketika kita memasuki pintu gerbang selatan prontera begitu kita menyelesaikan perjalanan yang sulit."}
, Summary = "Mari kita kembali ke prontera. Karian memiliki kenangan ketika ia masuk ke gerbang selatan prontera. "}
, 
[11155] = {Title = "Petarung tak terkalahkan", 
Description = {"Kekuatan apa itu? Dia telah dipukul sekuat tenaga... Itu skill yang luar biasa."}
, Summary = "Mari kita tahu tentang dia. "}
, 
[11156] = {Title = "Pekerjaan Rumah yang menggangu", 
Description = {"Ah?orang yang keras kepala?ke! Tolong tangkap 10 desert worf. Maka saya akan mempertimbangkannya."}
, Summary = "Mari kita menangkap 10 desert wolf."}
, 
[11157] = {Title = "Lembah Helmes", 
Description = {"Ini bukan janji yang dimaksudkan ... Silakan pergi ke lembah ^f57d7d yang terletak Yuno timur selatan^000000. Mungkin teman priest sedang meditasi."}
, Summary = "Mari kita bertemu dia di lembah Helmes."}
, 
[11158] = {Title = "Perjalanan untuk meditasi", 
Description = {"Saya sedang meditasi, sehingga saya tidak bisa menjawab Anda, tapi aku bisa memperkenalkan Anda kepada priestku. Dia benci kebisingan, jadi silahkan tunggu di ruang."}
, Summary = "Mari kita tunggu dia di ruangan."}
, 
[11159] = {Title = "Kabar dari Brian", 
Description = {"Ah... Sudah berapa hari berlalu sejak saya datang ke sini ? Kamu tahu sekarang hari apa ?"}
, Summary = "Mendengarkan Cerita Brian."}
, 
[11160] = {Title = "Kabar dari John", 
Description = {"Baiklah... Tidak apa-apa, jangan Khawatir.."}
, Summary = "Bertemu John."}
, 
[11161] = {Title = "Kabar dari Tyler", 
Description = {"Jika kamu sibuk, bisakah kamu menggaruk punggungku? Terasa sangat gatal saya merasa digigit oleh serang. Saya ragu ada serangga yang berani menggigit saya."}
, Summary = "Bertemu Tyler."}
, 
[11162] = {Title = "Kabar dari Rose", 
Description = {"Katakan kepadanya tidak ada masalah tetapi kenyataanya bahwa saya terlalu cantik. Karena saya sempurna."}
, Summary = "Bertemu Rose."}
, 
[11163] = {Title = "Kabar dari Bain", 
Description = {"Katakan saja bahwa saya baik-baik saja, Mudah kan ?"}
, Summary = "Bertemu Bain."}
, 
[11164] = {Title = "Kabar dari Lash", 
Description = {"Nah, jika Anda ingin tahu tentang situasi saya saat ini, tidak bisakah kamu melihat bahwa aku sehat dan lenganku yang sangat kuat seperti batu? Beritahu saja mereka apa yang kamu lihat! Hahahahaha..!"}
, Summary = "Bertemu Lash."}
, 
[11165] = {Title = "Pengiriman untuk Brian", 
Description = {"Setelah Frede marah, saya menyadari bahwa saya harus melihat diriku sendiri. Hahaha. Katakan pada Frede bahwa saya akan kembali ke desa begitu saya sudah sehat. "}
, Summary = "Selesai mengirim kepada Brian"}
, 
[11166] = {Title = "Pengiriman untuk John", 
Description = {"...Terima kasih, Mate.. "}
, Summary = "Selesai mengirim kepada John."}
, 
[11167] = {Title = "Pengiriman untuk Tyler", 
Description = {"Astaga!! Saya hampir saja kehabisan Bradium! Terima kasih banyak!"}
, Summary = "Selesai mengirim kepada Tyler."}
, 
[11168] = {Title = "Pengiriman untuk Rose", 
Description = {""}
, Summary = "Selesai mengirim kepada Rose."}
, 
[11169] = {Title = "Pengiriman untuk Bain", 
Description = {"Terima kasih banyak~ Sampai jumpa lain waktu~"}
, Summary = "Selesai mengirim kepada Bain."}
, 
[11170] = {Title = "Pengiriman untuk Lash", 
Description = {"Ohhhh!!! Pertolongan yang sangat berarti dari kamu!! Saya bisa mengakhiri hidup saya yang berharga jika tidak mendapat pertolongan dari kamu!"}
, Summary = "Selesai mengirim kepada Lash."}
, 
[11171] = {Title = "Permintaan Frede", 
Description = {"Kemarilah untuk duduk dan beristirahat, makan ini dahulu."}
, Summary = "Berbicara kepadanya lagi."}
, 
[11172] = {Title = "Permintaan Frede", 
Description = {"Teman-teman saya pasti berada di dalam goa karena saya melihat mereka datang untuk mengisi Bradium. Saya berharap mereka tetap sehat. Maukah kamu mengunjungi mereka untuk memastikan mereka baik-baik saja?"}
, Summary = "Bertemu teman dari Frede, Brian, John, Tyler, Rose, Bain, and Lash."}
, 
[11173] = {Title = "Permintaan Frede", 
Description = {"Aku minta maaf karena telah meminta bantuan kamu terus-menerus, tapi maukah kamu mengantarkan Bradium ke teman-temanku ? Jika kamu meminta Bouy di Bangunan di Barat laut dari desa, dia akan memberikan kamu beberapa refined Bradium. Tolonglah lakukan itu."}
, Summary = "Bertemu Bouy dan dapatkan refined Bradium."}
, 
[11174] = {Title = "Kekurangan Persediaan", 
Description = {"Membutuhkan banyak waktu untuk membuat Large Bradium tetapi tidak untuk Small Bradium. Kamu bisa mendapatkan pieces of Bradium dari monster di sekitar. Sekitar 30 pieces of Bradium cukup untuk dibagikan kepada 6 orang."}
, Summary = "Bradium tidak cukup. Dapatkan 30 buah small pieces of Bradium."}
, 
[11175] = {Title = "Kekurangan Persediaan", 
Description = {"Pekerjaan tangan lebih cepat untuk membuat Bradium dibandingkan dengan menggunakan mesin. Saya hanya perlu 1 jam untuk menyelesaikannya. Silahkan pergi beristirahat ketika saya sedang bekerja."}
, Summary = "Pekerjaanya nampaknya membutuhkan waktu 2 jam untuk selesai."}
, 
[11176] = {Title = "Untuk Temanku", 
Description = {"Pekerjaan selesai. Bouy sedikit panik karena sudah lama sekali dia tidak melakukan pekerjaan ini namun hasilnya bagus. Silahkan bawa ini kepada mereka."}
, Summary = "Berikan refined Bradium kepada teman-temanmu dan kembali ke Frede untuk menceritakannya."}
, 
[11182] = {Title = "Laporan Theore", 
Description = {"Theore tampaknya berada dalam keadaan panik. Tunggu sampai dia tenang kemudian bicaralah padanya lagi."}
, Summary = ""}
, 
[11183] = {Title = "Permintaan Theore", 
Description = {"Theore memintamu untuk menemukan Laphines yang pergi ke Splendide Field."}
, Summary = "Cari di barat daya Splendide Field 2"}
, 
[11184] = {Title = "Laphine sedang melarikan diri", 
Description = {"Kamu menemukan Laphine tanpa senjata di semak tapi dia langsung terbang."}
, Summary = "Lanjutkan pencarian disekitar Splendide Field 2"}
, 
[11185] = {Title = "Sebuah kantung kecil", 
Description = {"Kamu menemukan sebuah kantung kecil di semak. Kamu harus memberikannya pada Theore."}
, Summary = ""}
, 
[11186] = {Title = "Sebuah kantung kecil", 
Description = {"Bawa kembali kantung tersebut ke Splendide untuk menemukan pemiliknya."}
, Summary = ""}
, 
[11187] = {Title = "Mengembalikan fairy pouch", 
Description = {"Kamu menemukan Tired-looking Fairy, tapi kantung tersebut bukanlah miliknya. Kumpulkan petunjuk untuk mencari tahu siapa pemiliknya dan katakan pada Tired-looking Fairy."}
, Summary = ""}
, 
[11188] = {Title = "Pemilik fairy pouch", 
Description = {"Jika kamu berjanji untuk tidak mengatakan pada siapapun, kamu bisa bicara pada Kusmi lagi."}
, Summary = "Bicara pada Kusmi lagi."}
, 
[11189] = {Title = "Rute Pasokan Bifrost", 
Description = {"Kusmi masih membutuhkan bantuan karena rute pasokan ke daratan utama telah terputus."}
, Summary = "Bicara pada Kusmi lagi."}
, 
[11190] = {Title = "Rute Pasokan Bifrost", 
Description = {"Cari seorang Laphine Soldier di Splendide untuk melaporkan tentang rute pasokan."}
, Summary = ""}
, 
[11191] = {Title = "Retakan di Bifrost", 
Description = {"Kamu bisa pergi ke Alfheim melalui Maze di Hazy Forest. Tapi, tidak ada yang pernah kembali dari Maze di Hazy Forest."}
, Summary = "Kembali ke Kusmi."}
