, Summary = "Memeriksa Pendaftaran"}
, 
[12072] = {Title = "Berburu thara frog", 
Description = {"Apakah Anda pernah melihat katak merah? namanya adalah Thara Frog dan mereka sangat langka. Kita menyelidiki habitatnya. pergi berburu 20 Thara Frog. "}
, Summary = "Kalahkan 20 thara frog"}
, 
[12073] = {Title = "Kalahkan Cruiser", 
Description = {"Para boneka mainan ini menyerang orang. Hal ini tidak boleh terjadi! Anda akan membantu kami mengalahkan mereka, Kalahkan 15 itu sudah cukup."}
, Summary = "Kalahkan 15 Cruiser"}
, 
[12074] = {Title = "Kalahkan Kukre", 
Description = {"Di dalam laut, ada pencuri. Kukre sebagai tersangkanya. Pergi kalahkan 30 kukre."}
, Summary = "Kalahkan 30 Kukre"}
, 
[12075] = {Title = "Kalahkan orcbaby", 
Description = {"Populasi Orc semakin semakin meningkat. Ini mungkin sedikit kejam, tapi kita harus mengurangi populasi mereka."}
, Summary = "Kalahkan 15 orc baby"}
, 
[12076] = {Title = "Kalahkan orcwarroir", 
Description = {"Hanya berburu orc baby tidak cukup. Dapat Anda menghapus mengalahkan orc warrior juga? Kurasa 20 Orc Warrior sudah cukup."}
, Summary = "Kalahkan 20 Orc warrior"}
, 
[12077] = {Title = "Berburu vadon", 
Description = {"Anda mungkin pernah melihat kepiting dengan cangkang tebal, mereka adalah Vadon. Saya ingin Anda untuk berburu sekitar 15 vadon. "}
, Summary = "Kalahkan 15 Vadon"}
, 
[12078] = {Title = "Berburu Megalodon", 
Description = {"Para nelayan tidak mengambil ikan yang mati, sehingga ini dapat menjadi masalah. Bisakah Anda mengalahkan 30 Megalodon?"}
, Summary = "Kalahkan 30 Megalodon"}
, 
[12079] = {Title = "Berburu Mars", 
Description = {"Apakah Anda mau berburu mars? Saya tidak tahu persis habitat meraka, tetapi kamu pasti dapat menemukan mereka. Memburu 15 Mars."}
, Summary = "Kalahkan 15 mars"}
, 
[12080] = {Title = "Berburu Cornutus", 
Description = {"Seorang pejabat pemerintah kota ini mengalami cedera karena Cornutus saat di pantai. Kami mendapat perintah untuk membasmi meraka. Kalahkan 20 Cornus"}
, Summary = "Kalahkan 20 Cornutus"}
, 
[12081] = {Title = "Kalahkan Mist", 
Description = {"Akhir-akhir ini, banyak orang yang tinggal di desa ini ketakutan oleh hantu. Hantu bernama Myst yang tidak berbentuk. Bisakan kamu mengalahkan 15 Myst?"}
, Summary = "Kalahkan 15 Myst"}
, 
[12082] = {Title = "Berburu shellfish", 
Description = {"Jangan tanya saya mengapa. Seseorang meminta untuk memburu 30 shellfish. Lakukan itu sekarang juga."}
, Summary = "Kalahkan 30 shellfish"}
, 
[12083] = {Title = "Berburu Marine sphere", 
Description = {"Marine sphere? apa kamu tahu apa itu marine sphere? Kami mendapat permohonan untuk mengalahkan 15 marine sphere"}
, Summary = "Kalahkan 15 Marine sphere"}
, 
[12084] = {Title = "Berburu Phen", 
Description = {"Seorang pejabat pemerintah yang ingin makan ikan lezat meminta untuk memburu 20 Phen. Bisa Anda lakukan itu?"}
, Summary = "Kalahkan 20 Phen"}
, 
[12085] = {Title = "Kalahkan Orc Skeleton", 
Description = {"Ini adalah masalah dari istana karena Orc yang mati hidup kembali. Para prajurit pergi ke sana untuk membasminya tetapi mereka membutuhkan kekuatan lebih.. bisakah kamu lakukan itu? 15 kurasa cukup."}
, Summary = "Kalahkan 15 orc skeleton"}
, 
[12086] = {Title = "Kalahkan Zenorc", 
Description = {"Kami punya tugas untuk membasmi 30 makhluk aneh. Ayo laksanakan"}
, Summary = "Kalahkan 30 Zenorc"}
, 
[12087] = {Title = "Kalahkan mummy", 
Description = {"Ini permintaan yang mengerikan. mereka ingin Anda untuk mengalahkan 15 dari mummy. Ewww ~ ~ itu mengerikan. Saya tidak ingin kesana. Anda sanggup mengatasinya."}
, Summary = "Kalahkan 15 mummy"}
, 
[12088] = {Title = "Menyelesaikan Permintaan", 
Description = {"Anda menyelesaikan permintaan dari dewan."}
, Summary = "Menyelesaikan permintaan "}
, 
[12090] = {Title = "Pria Misterius", 
Description = {"Orang yang bernama lyoda itu tampaknya tahu masalah cukup penting. Mari kita bicara lagi padanya."}
, Summary = "Orang misterius"}
, 
[12091] = {Title = "Burning heart", 
Description = {"Lyoda meminta the burning heart. Dia tampaknya tidak akan bercerita sebelum kita memnuhi permintaannya."}
, Summary = "Buring heart."}
, 
[12092] = {Title = "Cerita yang panjang", 
Description = {"Kami memberikan semua heart yang Lyonda minta. Sekarang mari kita dengarkan kisahnya."}
, Summary = "Cerita yang panjang"}
, 
[12093] = {Title = "Catatan intelligence Lyoda", 
Description = {"Kami telah memasukan kekuatan holy ke dalam kastil glastheim untuk mendeteksi penjaga setia. If [^008855dia^000000] orang terpilih, ia dapat menditeksi kekuatan holy. Tapi jika ia manusia biasa seperti kita, maka ia tidak dapat melakukannya."}
, Summary = "Catatan intelligence Lyoda"}
, 
[12094] = {Title = "Surat pada perisai yang rusak", 
Description = {"Anda adalah orang yang memiliki kekuatan holy...."}
, Summary = "Ini cukup sulit untuk dipercaya!"}
, 
[12096] = {Title = "Menuju Karakas", 
Description = {"Mari masuk ke Karakas di tengah geffen."}
, Summary = "Menuju Karakas"}
, 
[12097] = {Title = "Persiapan", 
Description = {"Red Blood 3, Wind Of Verdure 3, Green Live 3, Crystal Blue 3."}
, Summary = "Basic preparation"}
, 
[12098] = {Title = "Perjalanan ke dungeon", 
Description = {"Ice Dungeon, Thor volcano, Jalan Buntu Mjolnir, Gonryun dungeon. Masing-masing terdapat detektor di tempat tersebut. Jika ada hal yang lebih dibutuhkan, sebaiknya Anda simpan lebih dari 1."}
, Summary = "4 dungeons"}
, 
[12099] = {Title = "Remove Root Cause", 
Description = {"Baby dragon yang ada di dekat akar Yggdrasilberry dilaporkan menetas disekitarnya. Menghabisi Baby dragon itu penting tapi kita tidak boleh membiarkan akar akar tersebut untuk mencegah permintaan ini datang lagi di lain waktu."}
, Summary = "Bunuh 10 Draco\'Egg - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12100] = {Title = "Violent Winged Insect", 
Description = {"Baru-baru ini menerima laporan penampakan serangga bersayap besar di dekat Rapine Camp. Kami tidak tahu seberapa jauh infestasi serangga ini dapat menyebar jadi harap memusnahkannya sebanyak mungkin."}
, Summary = "Bunuh 12 Luciola Vespas - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12101] = {Title = "Work Interference", 
Description = {"Ini datang dari rekan-rekan yang bekerja di tambang. Baby dragon tinggal di sekitar akar Yggdrasilberry menghancurkan tanah di sekitar tambang. Ini akan berbahaya jika kita tidak mengurusnya. Tolong habisi Baby dragon di dekat Yggdrasilberry."}
, Summary = "Bunuh 5 Draco - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12102] = {Title = "Intelligent Snakes", 
Description = {"Sebuah ras baru yang disebut Naga ditemukan di rawa-rawa dekat Rapine Camp. Masalahnya adalah bahwa mereka primitif yang pandai dan sering melakukan kekerasan. Kami akan memiliki banyak konflik dengan mereka di masa depan jika mereka memperluas koloni mereka. Tolong habisi para Naga dewasa."}
, Summary = "Bunuh 10 Naga - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12103] = {Title = "Legendary Creature", 
Description = {"Kami mendapatkan laporan terus-menerus dari penampakan seekor legenda kuda putih bersayap di dekat Rapine base. Bisakah kamu pergi ke sana dan melihatnya ? Ini bisa saja hanya halusinasi jadi harap pastikan untuk menyentuhnya dengan tanganmu untuk memastikan itu adalah makhluk hidup. "}
, Summary = "Bunuh 1 Cornus - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12104] = {Title = "Insects with an Appetite", 
Description = {"Reproduksi Centipede adalah masalah biasa, akan tetapi nafsu makan mereka akan mengancam keselamatan kita. Mereka menyerap mineral Bradium dan merusak pertambangan kami. Banyak Sapha kita yang kehilangan nyawa karena Centipede. Tolong musnahkan mereka."}
, Summary = "Bunuh 15 Centipede - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12105] = {Title = "Moving Rocks", 
Description = {"Mendapat laporan bahwa mineral mentah Bradium di tambang masih hidup. Sepertinya mineral Bradium mentah telah dirubah menjadi Golem oleh mantra kuno dan sekarang kita mungkin perlu  menutup tambang kami karena Golem itu. Bisakah kamu pergi ke sana dan mengalahkannya ?"}
, Summary = "Bunuh 10 Bradium Golem - Laporkan ke Hunting Dept. 1 Manager"}
, 
[12106] = {Title = "A child on the flower", 
Description = {"Mata-mata kami yang dikirim ke Rapine telah diserang oleh anak kecil yang terlihat seperti monster. Jadi kita harus memburu mereka,  kamu satu-satunya yang bisa memburu mereka karena kamu bukan berasal dari Rapine."}
, Summary = "Bunuh 15 Pinguicula - Laporkan ke Hunting Dept. 2 Manager"}
, 
[12107] = {Title = "Twisted Love", 
Description = {"Apakah kamu melihat Anak kecil seperti bunga, Pinguicula?  Orang-orang mengatakan dia telah berubah menjadi monster bunga. Mereka sangat kejam dan agresif. Silahkan kamu segera pergi untuk memeriksa dan mengobatinya, sebelum mereka tersebar di daerah itu."}
, Summary = "Bunuh 10 Dark Pinguicula - Laporkan ke Hunting Dept. 2 Manager"}
, 
[12108] = {Title = "Dangerous Plant Removal", 
Description = {"Beberapa Kolektor mineral telah hilang dan pastinya dilakukan oleh Nepenthes. Nepenthes mirip seperti Mandragora. Kita harus melakukan sesuatu untuk melindungi orang-orang tersebut.."}
, Summary = "Bunuh 12 Nepenthes - Laporkan ke Hunting Dept. 2 Manager"}
, 
[12109] = {Title = "Larva Extermination", 
Description = {"Mereka sudah menemukan habitat Centipede Larva. Kita bisa menghabisi mereka sekarang sehingga ibu Centipede akan berkurang. Bisakah kamu menemukan mereka dan menghabisinya ? Kamu harus berhati-hati terhadap ibu centipede yang ada di sekitarnya."}
, Summary = "Bunuh 14 Centipede Larva - Laporkan ke Hunting Dept. 2 Manager"}
, 
[12110] = {Title = "Demon of Water", 
Description = {"Penambang dari Nidhogg\'s nest melaporkan bahwa mereka diserang oleh hal yang aneh. Mereka terlihah seperti manusia yang terlihat seperti air, tapi itu pasti adalah sesuatu yang jahat bukan air biasa. Mungkin Nidhogg Dungeon adalah tempat asal mereka jadi tolonglah kamu pergi ke sana untuk memastikannya."}
, Summary = "Bunuh 7 Agua Elemental - Laporkan ke Hunting Dept. 2 Manager"}
, 
[12111] = {Title = "Bird with ugly face", 
Description = {"Tatachos awalnya adalah burung yang cantik dan mereka bisa terbang. Tetapi karena mereka menetap di sini, di mana tidak ada musuh alami. Mereka mulai menjadi gemuk dan malas dan akhirnya mereka menjadi sekarang, burung-burung yang jelek. Anda akan menjadi musuh alami yang baik bagi mereka. "}
, Summary = "Bunuh 10 Tatachos - Laporkan ke Hunting Dept. 2 Manager"}
, 
[12117] = {Title = "Withered Flower", 
Description = {"Area ini tadinya adalah tanah yang basah. Akan tetapi karena suatu alasan telah berubah selama bertahun-tahun.Bisakah anda membawa Withered Flower Sample ? Ini akan untuk penelitian pada perubahan lingkungan. "}
, Summary = "Dapatkan 6 Withered Flower - Laporkan ke Supply Dept. 1 Manager"}
, 
[12118] = {Title = "Welcomed Mineral", 
Description = {"Mesin penghalus Bradium telah rusak dan sekarang kita sulit untuk mengirimkan Refine Bradium kepada rekan-rekan kami di tambang. Jadi kita menggunakan semua petualang kita untuk membantu mengumpulkan refined Bradium. Tolong bawakan 3 Refined Bradium dari  Bradium Golem."}
, Summary = "Dapatkan 3 Refined Bradium - Laporkan ke Supply Dept. 1 Manager"}
, 
[12119] = {Title = "Valuable Textile", 
Description = {"Saya punya permintaan untuk membawa 16 Dragon\'s Manes. Dragon\'s Mane jarang sekali jatuh dari Dracos dan sangat amat langka. Barang itu biasa digunakan untuk membuat bendera, pakaian dan peralatan adat kami."}
, Summary = "Dapatkan 16 Dragon\'s Mane - Laporkan ke Supply Dept. 1 Manager"}
, 
[12120] = {Title = "Curious Meat", 
Description = {"Ini adalah permintaan dari pub untuk makanan orang-orang dari dunia lain. Mereka ingin Dragon Tail yang akan digunakan untuk bumbu masak yang dapat disimpan secara ekstensif. Jadi manusia pada menyukainya. Tolong bawakan 6 buah kepadaku."}
, Summary = "Dapatkan 6 Dragon Tails - Laporkan ke Supply Dept. 1 Manager"}
, 
[12121] = {Title = "Material Salju", 
Description = {"Jalan menuju ke kota sekarang tertutup oleh es. Menyebarkan Pieces of Egg Shells dapat membantu kita."}
, Summary = "Bawakan 26 Piece of Egg Shells - Laporkan ke Supply Dept. 1 Manager"}
, 
[12122] = {Title = "Material terdingin", 
Description = {"Bradium Processing Machinery menjadi sangat panas dan harus distabilkan dengan sejenis cairan. Untuk itu kita membutuhkan Crystalized Teardrops."}
, Summary = "Bawakan 6 Crystalized Teardrop - Laporkan ke Supply Dept. 1 Manager"}
, 
[12123] = {Title = "Cat terbaik", 
Description = {"Supply Manager mendadak membutuhkan cat untuk mengecat gedung di kota. Dia membutuhkan Fluorescent Liquid untuk itu."}
, Summary = "Bawakan 26 Fluorescent Liquid - Laporkan ke Supply Dept. 1 Manager"}
, 
[12124] = {Title = "Item berharga", 
Description = {"Botol air di dalam ruangan menteri rusak. Kita harus mencari gantinya segera."}
, Summary = "Bawakan 1 Small Bottle - Laporkan ke Supply Dept. 1 Manager"}
, 
[12125] = {Title = "Material Toko Armor", 
Description = {"Armor untuk para penjaga telah rusak. Mereka membutuhkan armor baru. Carikan 18 Scale Shell untuk mereka."}
, Summary = "Bawakan 18 Scale Shells - Laporkan ke Supply Dept. 1 Manager"}
, 
[12126] = {Title = "Material Armor lanjutan", 
Description = {"Selain prajurit, para komandan mereka juga membutuhkan armor baru, mereka menggunakan armor dengan bahan yang berbeda."}
, Summary = "Bawakan 11 Shining Scales - Laporkan ke Supply Dept. 1 Manager"}
, 
[12127] = {Title = "Alat Supervisor", 
Description = {"Sekarang adalah waktunya untuk memperbaiki Terompet. KArena benda itu sangat dibutuhkan oleh Supervisor. Bawakan 5 buah."}
, Summary = "Bawakan 5 Mystic Horns - Laporkan ke Supply Dept. 2 Manager"}
, 
[12128] = {Title = "Persiapan panas", 
Description = {"Sepertinya tidak ada cukup lembaran kulit untuk menahan musim dingin. Kita harus mencari lebih banyak lagi."}
, Summary = "Bawakan 21 Fur - Laporkan ke Supply Dept. 2 Manager"}
, 
[12129] = {Title = "Makanan mencurigakan", 
Description = {"Ada permintaan dari pemilik pub untuk membawakan 27 bug legs."}
, Summary = "Bawakan 27 Bug Legs - Laporkan ke Supply Dept. 2 Manager"}
, 
[12130] = {Title = "Material Berguna", 
Description = {"Zargon adalah material berharga disini. Sangat indah dan sempurna. Bisa digunakan sebagai obat jika dicampur dengan air. Carikan aku 26 Zargons."}
, Summary = "Bawakan 26 Zargon - Laporkan ke Supply Dept. 2 Manager"}
, 
[12131] = {Title = "Material penting untuk konstruksi", 
Description = {"Kita mendapat permintaan untuk menemukan bahan yang dibutuhkan oleh para pekerja. Yang kita butuhkan adalah 13 Solid shell."}
, Summary = "Bawakan 13 Solid Shells - Laporkan ke Supply Dept. 2 Manager"}
, 
[12132] = {Title = "Material penting untuk konstruksi 2", 
Description = {"Kita mendapat permintaan untuk menemukan bahan yang dibutuhkan oleh para pekerja. Yang kita butuhkan adalah 16 Strong Vines."}
, Summary = "Bawakan 16 Strong Vines - Laporkan ke Supply Dept. 2 Manager"}
, 
[12133] = {Title = "Pengaturan Dekorasi", 
Description = {"Para penjaga membutuhkan banyak Sharp Leaves. Banyak juga yang mencari item itu, sedangkan kita membutuhkannya juga. Cepatlah temukan 26 sharp leaves!"}
, Summary = "Bawakan 26 Sharp Leaves - Laporkan ke Supply Dept. 2 Manager"}
, 
[12134] = {Title = "Pembalasan Instan", 
Description = {"Pemilik pub kewalahan karena kebanjiran petualang di tempatnya. Ia membutuhkan bahan untuk mencatat pesanan mereka."}
, Summary = "Bawakan 11 Great Leaves - Laporkan ke Supply Dept. 2 Manager"}
, 
[12135] = {Title = "Tidak cukup obat", 
