, Summary = "Bawakan 16 Brown Root - Laporkan ke Supply Dept. 2 Manager"}
, 
[12136] = {Title = "Pencuri Madu", 
Description = {"Pemilik pub datang dan marah marah. Ia berkata tidak ada lagi stok madu karena ada pencuri. Kita harus menemukan madu itu. 2 buah Honey bisa membuatnya tenang."}
, Summary = "Bawakan 2 Honey - Laporkan ke Supply Dept. 2 Manager"}
, 
[12137] = {Title = "Alat Experimen", 
Description = {"Para peneliti membutuhkan alat untuk eksperimen mereka. Mereka membutuhkan item Life Force Pots."}
, Summary = "Bawakan 4 Life Force Pots - Laporkan ke Transport Dept. 1 Manager"}
, 
[12138] = {Title = "Hadiah yang indah", 
Description = {"Pemilik pub ingin memberikan hadiah untuk para pelanggannya. Tetapi ia tidak tahu apa yang harus diberikan. Jika kamu menemukan sesuatu yang berharga, bawakan lah"}
, Summary = "Bawakan 5 Bouquets - Laporkan ke Transport Dept. 1 Manager"}
, 
[12139] = {Title = "Kenikmatan rasa!", 
