, Summary = "Bawakan 15 Chinas - Laporkan ke Transport Dept. 1 Manager"}
, 
[12141] = {Title = "Kiriman Spesial", 
Description = {"Aku punya permintaan. Kudengar para seniman di Midgard sangat hebat. Aku penasaran dengan keindahan Glass Beads. Bawakan aku 10 buah benda itu."}
, Summary = "Bawakan 10 Glass Beads - Laporkan ke Transport Dept. 1 Manager"}
, 
[12142] = {Title = "Permintaan Berbahaya", 
Description = {"HmmAku tidak tahu darimana harus memulai. Perdana Menteri menginginkan boneka untuk anaknya. Bawakan Puppet dari Midgard."}
, Summary = "Bawakan 15 Puppets - Laporkan ke Transport Dept. 1 Manager"}
, 
[12143] = {Title = "Tren yang aneh", 
Description = {"Kudengar ada sejenis alat musik aneh dari Midgard yang menggunakan bulu dari sejenis burung. Coba bawakan aku bahan pembuat alat musik itu"}
, Summary = "Bawakan 50 Bill of Birds - Laporkan ke Transport Dept. 1 Manager"}
, 
[12144] = {Title = "Pengunaan asing", 
Description = {"Pemilik pub ingin merenovasi dengan bahan unik yang dinamakan Clam Shells. Bawakan ia 50 buah."}
, Summary = "Bawakan 50 Clam Shells - Laporkan ke Transport Dept. 1 Manager"}
, 
[12145] = {Title = "Makanan dari tempat lain", 
Description = {"Kita tidak punya makanan khas tetapi mereka sepertinya sangat menikmatinya. Jadi pemilik pub menginginkan tambahan piring untuk mereka. Bawakan 20 buah Crab Shells."}
, Summary = "Bawakan 20 Crab Shells - Laporkan ke Transport Dept. 1 Manager"}
, 
[12146] = {Title = "Mengisi kekosongan", 
Description = {"Kupikir item paling berguna di Midgard adalah Scell. Gunakan Scell untuk mengisi lubang apapun di bangunan dan campurkan dengan Garlet. Bisakah kamu membawakan 30 buah?"}
, Summary = "Bawakan 30 Scells - Laporkan ke Transport Dept. 1 Manager"}
, 
[12147] = {Title = "Material Asing", 
Description = {"Garlet adalah benda yang dibutuhkan untuk perbaikan gedung. Benda ini merupakan salah satu benda terpenting. Sebelum benda ini ditemukan, kita menggunakan Zargon. Bawakan aku 40 buah."}
, Summary = "Bawakan 40 Garlets - Laporkan ke Transport Dept. 1 Manager"}
, 
[12148] = {Title = "Umpan perburuan Tatacho", 
Description = {"Tatacho itu sangat cepat, kita akan kesulitan menangkap mereka. Jadi disini kita akan menggunakan umpan Monster\'s Feed. Dapatkan aku 100 Monster\'s feed."}
, Summary = "Bawakan 100 Monster\'s Feed - Laporkan ke Transport Dept. 2 Manager"}
, 
[12149] = {Title = "Pelatihan Swordman", 
Description = {"Pemilik pub menginginkan beberapa apel untuk belajar memasak. Tetapi aku tidak pernah mendengar siapapun yang menemukan buah itu. Dapatkan 100 Apple untuknya."}
, Summary = "Bawakan 100 Apples - Laporkan ke Transport Dept. 2 Manager"}
, 
[12150] = {Title = "Sayuran berwarna merah", 
Description = {"Ini adalah permintaan pemilik pub. Ia menginginkan sayuran untuk memasak sesuatu yang berwarna warni. Sepertinya kita bisa menggunakan Carrot. Bawakan 100 buah Carrot."}
, Summary = "Bawakan 100 Carrots - Laporkan ke Transport Dept. 2 Manager"}
, 
[12151] = {Title = "Permintaan Pemilik Pub", 
Description = {"Ada ledakan di pub. Kata mereka hal itu disebabkan sejenis sayuran bernama Pumpkin yang dipanggang di api. Pemilik menginginkan 100 buah Pumpkin lagi."}
, Summary = "Bawakan 100 Pumpkins - Laporkan ke Transport Dept. 2 Manager"}
, 
[12152] = {Title = "Masakan Rumahan", 
Description = {"Pemilik pub merindukan rasa Sweet Potato. Ia sering memakannya ketika masih kecil. Ia menginginkan 50 buah Sweet Potato."}
, Summary = "Bawakan 50 Sweet Potatos - Laporkan ke Transport Dept. 2 Manager"}
, 
[12153] = {Title = "Tanaman beracun", 
Description = {"Pemilik pub ingin memasak sesuatu yang aneh. Ia ingin memasak dengan Banana. Bawakan ia 100 buah Banana."}
, Summary = "Bawakan 100 Bananas - Laporkan Transport Dept. 2 Manager"}
, 
[12154] = {Title = "Tidak sengaja normal", 
Description = {"Pemilik pub menginginkan sesuatu lagi. Kali ini ia ingin memakan Meat. Kurasa 50 Meat sudah cukup untuknya."}
, Summary = "Bawakan 50 Meat - Laporkan ke Transport Dept. 2 Manager"}
, 
[12155] = {Title = "Hadiah spesial", 
Description = {"Aku ingin memberikan hadiah kepada Penjaga Bar. Aku melihatnya stres karena menghancurkan barang. Aku ingin memberinya 20 Black Scoop. Bawakan item itu. "}
, Summary = "Bawakan 20 black scoops. - Laporkan ke Transport Dept. 2 Manager"}
, 
[12156] = {Title = "Hormatilah Sesama!-2", 
Description = {"Perdana Menteri memintaku untuk membawakannya cermin kristal dari Midgard. Kita harus membawakan 5 buah Crystal Mirror untuknya."}
, Summary = "Bawakan 5 crystal mirrors - Laporkan ke Transport Dept. 2 Manager"}
, 
[12157] = {Title = "Keinginan Penjaga Bar", 
Description = {"Pemilik pub memintaku untuk mengirimkan 2 Pineapple untuknya. Aku malas mengerjakannya, jadi tolong bantulah aku."}
, Summary = "Bawakan 2 pineapple - Laporkan ke Transport Dept. 2 Manager"}
, 
[12158] = {Title = "Kemarahan Penjaga Bar", 
Description = {"Sekali lagi, Penjaga Bar meminta bantuanku untuk mencari 2 buah Melon. Tolong bantulah aku."}
