[14118] = {Title = "Kekhawatiran Wuhari", 
Description = {"Wuhari sangat menghawatirkan kabar saudaranya di penjara. Berikan surat Wuhari kepada saudaranya di penjara."}
, Summary = "Kirimkan surat pada Wuhuru."}
, 
[14119] = {Title = "Ujian kesabaran", 
Description = {"Tahanannya tidak merespon pembicaraan. Sepertinya dia sedang menguji kesabaranku."}
, Summary = "Bicaralah dengan tahanannya."}
, 
[14120] = {Title = "Ujian kesabaran 2", 
Description = {"Tahanannya masih tidak merespon meskipun sudah diajak bicara berkali-kali. Ayo kita coba lagi."}
, Summary = "Bicaralah dengan tahanannya."}
, 
[14121] = {Title = "Ujian kesabaran 3", 
Description = {"Orang itu tampaknya tetap tidak mau berbicara. Apakah ada cara lain untuk berbicara dengannya."}
, Summary = "Bicaralah dengan tahanannya."}
, 
[14122] = {Title = "Waktu untuk berdua", 
Description = {"Surat dari Wuhari telah diberikan kepada Wuhuru. Dia meminta waktu untuk membaca suratnya. Jangan ganggu saat dia membaca suratnya."}
, Summary = "Berikan dia waktu untuk membaca suratnya."}
, 
[14123] = {Title = "Permintaan Wuhuru", 
Description = {"Setelah membaca surat dari saudaranya, Wuhuru mulai membagi ceritanya dan memintamu untuk mengirimkan salam untuk saudaranya. Kembalilah ke Wuhari dan berikan salam dari saudaranya."}
, Summary = "Berikan salam untuk Wuhari."}
, 
[14125] = {Title = "Memeriksa area", 
Description = {"Wuhari sedang mencari cara untuk memulihkan tubuh Wuhuru. Tapi, dia tidak tahu caranya. Apakah orang yang tinggal di sekitar area tersebut tahu sesuatu? Periksa daerah sekitar."}
, Summary = "Bicaralah kepada penduduk dikota."}
, 
[14126] = {Title = "Pencarian Ms. Goatie", 
Description = {"Mr. Masione mengatakan kalau tidak mengetahuinya. Tapi menunjuk Ms. Goatie yang lebih mengerti tentang hal seperti ini"}
, Summary = "Cari Ms. Goatie."}
, 
[14127] = {Title = "Pencarian suami Ms. Goatie", 
Description = {"Ms. Goatie membicarakan betapa senangnya Wuhuru sambil menggoyangkan secarik kertas diudara. Saat menanyakan tentang kertasnya, dia mengatakan kalau suaminya lebih tahu tentang hal itu."}
, Summary = "Cari suami Ms. Goatie."}
, 
[14128] = {Title = "Laporan penelitian", 
Description = {"Mr. Svery yang selalu dekat dengan Wuhuru tahu lebih banyak. Isi dari surat yang ditinggalkan Wuhuru adalah laporan penelitiannya. Berikan kepada Wuhari."}
, Summary = "Kirimkan Laporannya."}
, 
[14131] = {Title = "Saatnya analisa", 
Description = {"Wuhari mendapatkan laporannya, tapi menyebut akan membutuhkan waktu untuk menganalisa laporannya. Cobalah bicara dengannya lagi nanti. Jangan ganggu orang yang sedang mempelajarinya."}
, Summary = "Saatnya analisa."}
, 
[14133] = {Title = "Permintaan lain", 
Description = {"Wuhari telah menganalisa laporannya, tapi masih belum yakin bagaimana cara memulihkan tubuh saudaranya. Coba cari dan tanyakan Laphine yang meminta Wuhuru berpartisipai dalam penelitian ini."}
, Summary = "Dapatkan buktinya."}
, 
[14134] = {Title = "Ms. Goatie yang pintar", 
Description = {"Meskipun mengunjungin Mr. Svery untuk mendapatkan informasi, dia mengatakan tidak tahu tentang Laphine level tinggi. Tapi, dia menyarankan untuk menemui istrinya yang lebih tahu tentang hal ini."}
, Summary = "Menuju ke Ms. Goatie."}
, 
[14135] = {Title = "Pencarian Mr. Pompe", 
